,"type":"GlyphRenderer"},{"attributes":{"callback":null,"tooltips":[["T (degC)","@Temperature"],["es (Pa)","@Pressure{0.3f}"]]},"id":"55959","type":"HoverTool"},{"attributes":{},"id":"58948","type":"StringEditor"},{"attributes":{"args":{"AirTemperature":{"id":"55855"},"RelativeHumidity":{"id":"55856"},"sourcePlotSlider":{"id":"55866"},"sourceVapourParameterTable":{"id":"55857"},"source_Arrows":{"id":"55867"},"source_Labels":{"id":"55868"}},"code":"\n                                // Slider data ////////////////////////////////\n                                const Ta = AirTemperature.value;\n                                const Rh = RelativeHumidity.value;\n                                const TaMin = -20\n                                \n                                // Declare variables //////////////////////////\n                                var es, e, sat_def, rho_vs, rho_v, lv\n                                \n                                // calcs //////////////////////////////////////\n                                \n                                function getEvaporationParameters(Ta,Rh) {\n                                    es = 611*Math.exp(17.27*Ta/(237.3+Ta));\n                                    e = Rh/100*es;\n                                    lv = (2.501*10**6 - 2370*Ta)/1000;\n                                    return [es,e,Rh, lv];\n                                    }\n\n                                function getTdFromE(e,Ta) {\n                                    \n                                    var dTd, Td_OLD, Td\n                                    const tol = 10**-10\n                                    dTd = tol + 1\n                                    Td_OLD = Ta-10\n                                    while (dTd &gt;= tol) {\n                                        Td = Math.log(e/611)*(237.3+Td_OLD)/17.27\n                                        dTd = Math.abs(Td - Td_OLD)\n                                        Td_OLD = Td\n                                        }\n                                    return Td\n                                    }\n                                    \n                                // update table source data ///////////////////\n                                \n                                let EvaporationParameters = getEvaporationParameters(Ta,Rh)\n                                let Td = getTdFromE(e,Ta)\n                                sat_def = es - e\n                                rho_vs = es/461/(Ta+273)\n                                rho_v = e/461/(Ta+273)\n                                sourceVapourParameterTable.data['Value'][0] = es.toFixed(2);\n                                sourceVapourParameterTable.data['Value'][1] = e.toFixed(2);\n                                sourceVapourParameterTable.data['Value'][2] = Td.toFixed(2);\n                                sourceVapourParameterTable.data['Value'][3] = sat_def.toFixed(2);\n                                sourceVapourParameterTable.data['Value'][4] = rho_vs.toExponential(3);\n                                sourceVapourParameterTable.data['Value'][5] = rho_v.toExponential(3);\n                                sourceVapourParameterTable.data['Value'][6] = lv.toFixed(2);\n                                sourceVapourParameterTable.change.emit();\n                                \n                                // update annotation lines ////////////////////\n                                source_Arrows.data['x_start'] = [Ta, Ta, Td, Ta, Ta]\n                                source_Arrows.data['x_end'] = [Ta, Ta, Td, TaMin, TaMin]\n                                source_Arrows.data['y_start'] = [e, e, e, e, es]\n                                source_Arrows.data['y_end'] = [0, es, 0, e, es]\n                                source_Arrows.change.emit();\n\n                                // update labels ///////////////////////////////\n                                source_Labels.data['y'] = [(e+es)/2, e, es, 500, 500]\n                                if (Ta&gt;=26){\n                                        source_Labels.data['x'] = [Ta-1, -18, -18, Ta-1, Td+1]\n                                        source_Labels.data['text_align'] = ['right','left','left','right','left'] \n                                        }\n                                else if (Ta&lt;26) {\n                                        source_Labels.data['x'] = [Ta+1, -18, -18, Ta-1, Td-1]\n                                        source_Labels.data['text_align'] = ['left','left','left','right','left'] \n                                        }\n                                source_Labels.change.emit();\n                                \n                                // update slider point in plot ////////////////\n                                sourcePlotSlider.data['Temperature'][0] = Ta\n                                sourcePlotSlider.data['Temperature'][1] = Td\n                                sourcePlotSlider.data['Temperature'][2] = Ta\n                                sourcePlotSlider.data['Pressure'][0] = es\n                                sourcePlotSlider.data['Pressure'][1] = e\n                                sourcePlotSlider.data['Pressure'][2] = e\n                                sourcePlotSlider.change.emit();\n\n                            "},"id":"55961","type":"CustomJS"},{"attributes":{"toolbar":{"id":"56288"},"toolbar_location":"above"},"id":"56289","type":"ToolbarBox"},{"attributes":{"text":"&lt;h2&gt;Computed Parameters&lt;/h2&gt;"},"id":"55965","type":"Div"},{"attributes":{},"id":"59098","type":"UnionRenderers"},{"attributes":{"coordinates":null,"group":null,"text":"Lapse Rate = 6.5deg/km","text_color":"#5B5B5B","text_font":"Calibri Light","text_font_size":"1.25em","text_font_style":"bold"},"id":"55980","type":"Title"},{"attributes":{"line_alpha":0.2,"line_width":5,"x":{"field":"x"},"y":{"field":"y"}},"id":"58255","type":"Line"},{"attributes":{"coordinates":null,"group":null,"text":"Copyright 2022, Dr Nick Cartwright, Griffith University","text_align":"center","text_alpha":0.5,"text_font_size":"10px","x":15.0,"y":6170.3995405140995},"id":"55957","type":"Label"},{"attributes":{"source":{"id":"57134"}},"id":"57168","type":"CDSView"},{"attributes":{},"id":"59082","type":"UnionRenderers"},{"attributes":{"fill_color":{"value":"blue"},"hatch_color":{"value":"blue"},"line_color":{"value":"blue"},"x":{"field":"T"},"y":{"field":"z"}},"id":"56015","type":"Circle"},{"attributes":{"line_alpha":0.2,"line_color":"blue","line_width":2,"x":{"field":"x"},"y":{"field":"H"}},"id":"58249","type":"Line"},{"attributes":{"button_type":"success","icon":null,"js_event_callbacks":{"button_click":[{"id":"55963"}]},"label":"Click to Restore Defaults","width":100},"id":"55962","type":"Button"},{"attributes":{"line_color":"blue","line_width":2,"x":{"field":"x"},"y":{"field":"H"}},"id":"58247","type":"Line"},{"attributes":{},"id":"59101","type":"Selection"},{"attributes":{"source":{"id":"58193"}},"id":"58251","type":"CDSView"},{"attributes":{"args":{"AirTemperature_slider":{"id":"55855"},"RelativeHumidity_slider":{"id":"55856"}},"code":"\n                                         AirTemperature_slider.value = 28.5;\n                                         RelativeHumidity_slider.value = 55;\n                                    "},"id":"55963","type":"CustomJS"},{"attributes":{"fill_color":{"field":"color"},"marker":{"value":"circle_dot"},"size":{"value":8},"x":{"field":"x"},"y":{"field":"zD"}},"id":"57567","type":"Scatter"},{"attributes":{},"id":"59081","type":"Selection"},{"attributes":{"line_alpha":0.1,"line_color":"blue","line_width":2,"x":{"field":"x"},"y":{"field":"H"}},"id":"58248","type":"Line"},{"attributes":{},"id":"56732","type":"Selection"},{"attributes":{"text":"\n        &lt;a id=\"Background\"&gt;&lt;h2&gt;Background&lt;/h2&gt;&lt;/a&gt;                         \n        &lt;p&gt;Water vapour plays a critical role in the hydrologic cycle. \n            The amount of vapour in the atmosphere limits the amount of possible rainfall.\n            Also, the latent heat energy involved in the changes of state from liquid to vapour (&lt;i&gt;evaporation &amp;#8594; energy consumed&lt;/i&gt;) and from vapour to liquid (&lt;i&gt;condensation &amp;#8594; energy released&lt;/i&gt;) is a key factor in weather events.\n        &lt;/p&gt;\n\n        &lt;h3&gt;Relative humidity&lt;/h3&gt;\n        &lt;p&gt;The amount of vapour in the air is commonly described in terms of the relative humidity, &lt;br&gt;\n            $$\\quad R_h = \\frac{e}{e_s}$$ &lt;br&gt;\n            where $$e_s$$ is the saturation vapour pressure and $$e$$ is the actual vapour pressure.\n        &lt;/p&gt;\n\n        &lt;h3&gt;Vapour pressure&lt;/h3&gt;\n        &lt;p&gt;\n            A measure of the amount of vapour in the atmosphere is the partial pressure of water vapour ($$e$$) - the more vapour the greater the partial pressure exerted. The &lt;b&gt;&lt;u&gt;saturated&lt;/u&gt;&lt;/b&gt; vapour pressure corresponds to the situation where the rate of evaporation from a surface equals the rate of condensation - ie a state of equillibrium.\n        &lt;/p&gt;\n        &lt;p&gt;The &lt;u&gt;saturated&lt;/u&gt; vapour pressure is dependent on the air temperature and is given by, &lt;br&gt;\n            $$\\quad e_s\\left(T_a\\right) = 611\\exp\\left({\\frac{17.27T_a}{237.3 + T_a}}\\right) \\quad (Pa) $$ &lt;br&gt;\n            where $$T_a$$ is the (dry bulb) air temperature in $$^\\circ C$$.\n        &lt;/p&gt;\n        &lt;p&gt;The &lt;u&gt;actual&lt;/u&gt; vapour pressure is estimated using the same equation but using the dew point (wet bulb) temperature ($$T_d$$ in $$^\\circ C$$) in place of the (dry bulb) air temperature ($$T_a$$), &lt;br&gt;\n            $$\\quad e = e_s\\left(T_d\\right) = 611\\exp\\left({\\frac{17.27T_d}{237.3 + T_d}}\\right) \\quad (Pa) $$\n        &lt;/p&gt;\n        &lt;p&gt;This applet computes $$e$$ from the relative humidity,&lt;br&gt;\n            $$\\quad e = R_he_s$$\n        &lt;/p&gt;\n        \n        &lt;h3&gt;The saturation deficit&lt;/h3&gt;\n        &lt;p&gt;The saturation deficit is a measure of the amount of vapour in the air relative to what could potentially be present at saturated conditions. It is given by, &lt;br&gt;\n            $$\\quad e_s-e$$\n        &lt;/p&gt;\n        \n\n        &lt;h3&gt;Vapour density&lt;/h3&gt;\n        &lt;p&gt;The mass (or density) of vapour in the air can then be estimated using the ideal gas law, &lt;br&gt;\n            $$\\quad e = \\rho_{v}R_vT \\quad \\left(Pa\\right)$$ &lt;br&gt;\n            where $$\\rho_v$$ is the vapour density $$\\left(kg/m^3\\right)$$, $$R_v = 461 J/kg/^\\circ K$$  is the universal gas constant and $$T$$ is the temperature in $$^\\circ K$$ $$\\left(=^\\circ C + 273\\right)$$.\n        &lt;/p&gt;\n        \n        &lt;h3&gt;Latent heat of vapourisation&lt;/h3&gt;\n        &lt;p&gt;The latent of vapourisation is the the amount of heat energy that is &lt;u&gt;consumed&lt;/u&gt; during the process of evaporation. \n            Conversely, the latent heat of condensation (which has the same magnitude), is the amount of heat energy that is &lt;u&gt;released&lt;/u&gt; during condensation.&lt;br&gt;\n            The latent of vapourisation for water is a weak function of temperature and is given by, &lt;br&gt;\n            $$\\quad l_v = 2.501 \\times 10^6 - 2370T_a \\quad (Joules/kg)$$ &lt;br&gt;\n            where $$T_a$$ is the air temperature in $$^\\circ C$$\n        &lt;/p&gt;\n\n    "},"id":"55966","type":"Div"},{"attributes":{"line_width":5,"x":{"field":"x"},"y":{"field":"y"}},"id":"58253","type":"Line"},{"attributes":{"coordinates":null,"data_source":{"id":"58193"},"glyph":{"id":"58247"},"group":null,"hover_glyph":null,"muted_glyph":{"id":"58249"},"nonselection_glyph":{"id":"58248"},"view":{"id":"58251"}},"id":"58250","type":"GlyphRenderer"},{"attributes":{"source":{"id":"57452"}},"id":"57552","type":"CDSView"},{"attributes":{"fill_alpha":{"value":0.1},"fill_color":{"value":"white"},"hatch_alpha":{"value":0.1},"line_alpha":{"value":0.1},"marker":{"value":"circle_dot"},"size":{"value":8},"x":{"field":"x"},"y":{"field":"y"}},"id":"57549","type":"Scatter"},{"attributes":{"line_alpha":0.1,"line_width":5,"x":{"field":"x"},"y":{"field":"y"}},"id":"58254","type":"Line"},{"attributes":{},"id":"56731","type":"UnionRenderers"},{"attributes":{"text":"&lt;h1&gt;Water Vapour&lt;/h1&gt;\n                   &lt;p&gt;\n                       This applet examines the relationship between saturation vapour pressure ($$e_s$$), actual vapour pressure ($$e$$) and relative humidity ($$R_h$$) and their dependence on air temperatute $$(T_a)$$. The density of water vapour ($$\\rho_v$$) is also computed using the ideal gas law.\n                       &lt;i&gt;Further details are provided in the &lt;a href=\"#Background\"&gt;&lt;b&gt;Background&lt;/b&gt;&lt;/a&gt; section below&lt;/i&gt;.\n                   &lt;/p&gt;\n                   "},"id":"55964","type":"Div"},{"attributes":{},"id":"59077","type":"Selection"},{"attributes":{"data":{"index":[0],"label":[" "],"text_align":["left"],"text_baseline":["bottom"],"text_color":["red"],"x":{"__ndarray__":"AAAAAAAANEA=","dtype":"float64","order":"little","shape":[1]},"x_offset":{"__ndarray__":"AAAAAAAAAAA=","dtype":"float64","order":"little","shape":[1]},"y":{"__ndarray__":"AAAAAAAAJEA=","dtype":"float64","order":"little","shape":[1]},"y_offset":[0]},"selected":{"id":"59013"},"selection_policy":{"id":"59012"}},"id":"57574","type":"ColumnDataSource"},{"attributes":{"coordinates":null,"data_source":{"id":"58193"},"glyph":{"id":"58253"},"group":null,"hover_glyph":null,"muted_glyph":{"id":"58255"},"nonselection_glyph":{"id":"58254"},"view":{"id":"58257"}},"id":"58256","type":"GlyphRenderer"},{"attributes":{"text":"&lt;h2&gt;User Input Controls&lt;/h2&gt;\n                             &lt;p&gt;Move sliders to adjust input parameter values.&lt;br&gt;\n                             &lt;i&gt;&lt;span style=\"color: #ff0000\"&gt;&lt;b&gt;&lt;u&gt;Tip:&lt;/b&gt;&lt;/u&gt;&lt;/span&gt; Click slider and then use left/right arrows on keyboard for greater control.&lt;/i&gt;\n                             &lt;/p&gt;"},"id":"55970","type":"Div"},{"attributes":{"fill_color":{"value":"white"},"marker":{"value":"circle_dot"},"size":{"value":8},"x":{"field":"x"},"y":{"field":"y"}},"id":"57548","type":"Scatter"},{"attributes":{"height":5,"style":{"font-size":"80%"},"text":"&lt;p&gt;&lt;img src=\"images/copyright-symbol.png\" alt=\"Copyright\" width=\"10\"&gt; 2022, Dr Nick Cartwright, Griffith University&lt;/p&gt;"},"id":"55968","type":"Div"},{"attributes":{"args":{"slider_A":{"id":"57797"},"slider_Coutflow":{"id":"57800"},"slider_Ho":{"id":"57796"},"slider_Ip":{"id":"57798"},"slider_dt":{"id":"57802"},"slider_t_base":{"id":"57799"},"slider_time":{"id":"57801"}},"code":"\n                                         // sliders ///////////////////////////\n                                         slider_Ho.value = 11;\n                                         slider_A.value = 50;\n                                         slider_Ip.value = 100;\n                                         slider_t_base.value = 5;\n                                         slider_Coutflow.value = 42;\n                                         slider_time.value = 1;\n                                         slider_dt.value = 0.1;\n                                         \n                                         "},"id":"58260","type":"CustomJS"},{"attributes":{"children":[{"id":"55970"},{"id":"55855"},{"id":"55856"},{"id":"55962"},{"id":"55965"},{"id":"55863"}],"width":350},"id":"55971","type":"Column"},{"attributes":{},"id":"57143","type":"LinearScale"},{"attributes":{"children":[{"id":"55971"},{"id":"55899"}]},"id":"55972","type":"Row"},{"attributes":{"children":[{"id":"57293"}]},"id":"57294","type":"Column"},{"attributes":{"fill_alpha":{"value":0.2},"fill_color":{"value":"white"},"hatch_alpha":{"value":0.2},"line_alpha":{"value":0.2},"marker":{"value":"circle_dot"},"size":{"value":8},"x":{"field":"x"},"y":{"field":"y"}},"id":"57550","type":"Scatter"},{"attributes":{"source":{"id":"58193"}},"id":"58257","type":"CDSView"},{"attributes":{"tabs":[{"id":"56790"},{"id":"57292"}],"tabs_location":"left"},"id":"57293","type":"Tabs"},{"attributes":{"args":{"slider_A":{"id":"57797"},"slider_Coutflow":{"id":"57800"},"slider_Ho":{"id":"57796"},"slider_Ip":{"id":"57798"},"slider_dt":{"id":"57802"},"slider_t_base":{"id":"57799"},"slider_time":{"id":"57801"},"source_Hydrographs":{"id":"57819"},"source_Reservoir":{"id":"58193"},"source_TableHSOG":{"id":"57803"},"source_TableOutput":{"id":"58187"},"source_TimePoint":{"id":"57954"}},"code":"\n                            // get slider values //////////////////////////////\n                            const z_spillway = 11.\n                            const Ho = slider_Ho.value;\n                            const A = slider_A.value;\n                            const Ip = slider_Ip.value;\n                            const t_base = slider_t_base.value;\n                            const C = slider_Coutflow.value;\n                            const time_slider_value = parseFloat(slider_time.value.toFixed(1));\n                            const dt = slider_dt.value;\n                            \n                            // compute new HSOG ///////////////////////////////\n                            const Ht = source_TableHSOG.data['H'];\n                            \n                            // add length of spillway\n                            var St = []\n                            var Gt = []\n                            var Ot = []\n                            for (let ii = 0; ii &lt; Ht.length; ii++) {\n                                St[ii] = A*10000*Ht[ii];\n                                if (Ht[ii] &lt; z_spillway) {\n                                        Ot[ii] = 0}\n                                else {\n                                    Ot[ii] = C*(Ht[ii]-z_spillway)**1.5;\n                                    }\n                                Gt[ii] = 2*St[ii]/(dt*3600) + Ot[ii];\n                                }\n                            source_TableHSOG.data['S'] = St;\n                            source_TableHSOG.data['O'] = Ot;\n                            source_TableHSOG.data['G'] = Gt;\n                            source_TableHSOG.change.emit();\n                            \n                            // LinearInterpolation ////////////////////////////\n\t                        const interpolate = (xarr, yarr, xpoint) =&gt; {\n                            \tconst\txa = [...xarr].reverse().find(x =&gt; x &lt;= xpoint),\n                            \t\t\txb = xarr.find(x =&gt; x &gt; xpoint),      \n                            \t\t\tya = yarr[xarr.indexOf(xa)],      \n                            \t\t\tyb = yarr[xarr.indexOf(xb)];\n                            \treturn ya+(xpoint-xa)*(yb-ya)/(xb-xa) // linear interp\n                                // return yarr[xarr.indexOf(xpoint)] // nearest neighbour\n                            }\n\n                            // compute new inflow hydrograph //////////////////\n                            var t = [], I = [], O = [], S = [], G = [], H = [], index=[];\n                            var slope = Ip/t_base*2;\n                            var tIp = t_base/2;\n                            var tOp, Op, Hp\n                            \n                            t[0] = 0;\n                            index[0] = 0;\n                            I[0] = 0;\n                            H[0] = Ho;\n                            O[0] = interpolate(Ht,Ot,H[0]);\n                            S[0] = interpolate(Ht,St,H[0]);\n                            G[0] = interpolate(Ht,Gt,H[0]);\n                            H[0] = Ho;\n                            Op = 0;\n                            Hp = 0;\n                            var ii = 0;\n                            // while (t[ii] &lt; 2*t_base)\n                            while (t[ii] &lt; 20)\n                                {   ii = ii + 1;\n                                    t[ii] = t[ii-1] + dt;\n                                    t[ii] = parseFloat(t[ii].toFixed(1)) \n                                    // inflow HG\n                                    if (t[ii] &lt;= tIp) { // rising limb\n                                        I[ii] = I[ii-1] + slope*dt;\n                                        }\n                                    else { // falling limb\n                                        I[ii] = I[ii-1] - slope*dt;\n                                        }\n                                    if (I[ii]&lt;0) {I[ii]=0}\n                                    \n                                    // storage equation ///////////////////////\n                                    G[ii] = I[ii-1] + I[ii] + G[ii-1] -2*O[ii-1];\n                                    O[ii] = interpolate(Gt,Ot,G[ii]);\n                                    S[ii] = interpolate(Gt,St,G[ii]);\n                                    H[ii] = interpolate(Gt,Ht,G[ii]);\n                                    index[ii] = ii;\n                                    \n                                    // get max ////////////////////////////////\n                                    if (O[ii]&gt;=Op){Op=O[ii]; tOp=t[ii]; Hp=H[ii];}\n                                }\n\n                            // update hydrograph column data source ///////////\n                            source_Hydrographs.data['index'] = index;\n                            source_Hydrographs.data['t'] = t;\n                            source_Hydrographs.data['I'] = I;\n                            source_Hydrographs.data['O'] = O;\n                            source_Hydrographs.data['S'] = S;\n                            source_Hydrographs.data['H'] = H;\n                            source_Hydrographs.data['G'] = G;\n                            source_Hydrographs.change.emit();     \n                            \n                            // update hydrograph time point data //////////////\n                            source_TimePoint.data['tPoint'] = [time_slider_value, time_slider_value];\n                            source_TimePoint.data['yPoints'][0] = source_Hydrographs.data['I'][source_Hydrographs.data['t'].indexOf(time_slider_value)];\n                            source_TimePoint.data['yPoints'][1] = source_Hydrographs.data['O'][source_Hydrographs.data['t'].indexOf(time_slider_value)];\n                            source_TimePoint.data['yLine'][1] = Math.max(source_Hydrographs.data['I'][source_Hydrographs.data['t'].indexOf(time_slider_value)],source_Hydrographs.data['O'][source_Hydrographs.data['t'].indexOf(time_slider_value)]);\n                            source_TimePoint.data['Hpt'][0] = source_Hydrographs.data['H'][source_Hydrographs.data['t'].indexOf(time_slider_value)];\n                            source_TimePoint.data['Hpt'][1] = source_TimePoint.data['Hpt'][0];\n                            source_TimePoint.data['Spt'][0] = source_Hydrographs.data['S'][source_Hydrographs.data['t'].indexOf(time_slider_value)];\n                            source_TimePoint.data['Spt'][1] = source_TimePoint.data['Spt'][0];\n                            source_TimePoint.data['Opt'][0] = source_Hydrographs.data['O'][source_Hydrographs.data['t'].indexOf(time_slider_value)];\n                            source_TimePoint.data['Opt'][1] = source_TimePoint.data['Opt'][0];\n                            source_TimePoint.data['Gpt'][0] = source_Hydrographs.data['G'][source_Hydrographs.data['t'].indexOf(time_slider_value)];\n                            source_TimePoint.data['Gpt'][1] = source_TimePoint.data['Gpt'][0];\n                            source_TimePoint.change.emit();\n                            \n                            // update reservoir data //////////////////////////\n                            const w = Math.sqrt(A*10000)\n                            const z_bottom = 10\n                            source_Reservoir.data['x'] = [0,0,w,w]\n                            source_Reservoir.data['y'] = [1.1*Hp,z_bottom,z_bottom,z_spillway]\n                            source_Reservoir.data['H'] = [source_TimePoint.data['Hpt'][0],source_TimePoint.data['Hpt'][0],source_TimePoint.data['Hpt'][0],source_TimePoint.data['Hpt'][0]]\n                            source_Reservoir.data['z_spillway'] = [z_spillway,z_spillway,z_spillway,z_spillway]\n                            source_Reservoir.change.emit()\n                            \n                            // update output table ////////////////////////////\n                            var Ivol = dt*3600*I.reduce((a, b) =&gt; a + b, 0);\n                            var Ovol = dt*3600*O.reduce((a, b) =&gt; a + b, 0);\n                            var Svol = S.reduce((a, b) =&gt; a + b, 0) - S[0];\n                            var Attenuation = 100*(1-Op/Ip);\n                            const TimeLag = tOp - tIp;\n                            source_TableOutput.data['Value'][0] = dt.toFixed(3);\n                            //source_TableOutput.data['Value'][1] = Ivol.toFixed(1);\n                            //source_TableOutput.data['Value'][2] = Ovol.toFixed(1);\n                            //source_TableOutput.data['Value'][3] = Svol.toFixed(1);\n                            source_TableOutput.data['Value'][1] = Ip.toFixed(2);\n                            source_TableOutput.data['Value'][2] = Op.toFixed(2);\n                            source_TableOutput.data['Value'][3] = Attenuation.toFixed(2);\n                            source_TableOutput.data['Value'][4] = TimeLag.toFixed(2);\n                            source_TableOutput.change.emit();\n                            \n                            \n                            \n                                 "},"id":"58258","type":"CustomJS"},{"attributes":{"axis_label":"$$\\theta \\text{ (vol/vol)}$$","axis_label_standoff":10,"axis_label_text_color":"#5B5B5B","axis_label_text_font":"Calibri Light","axis_label_text_font_size":"1.15em","axis_label_text_font_style":"bold","axis_line_alpha":1,"axis_line_color":"#5B5B5B","coordinates":null,"formatter":{"id":"57181"},"group":null,"major_label_policy":{"id":"57182"},"major_label_text_color":"#5B5B5B","major_label_text_font":"Calibri Light","major_label_text_font_size":"0.95em","major_label_text_font_style":"bold","major_tick_in":0,"major_tick_line_alpha":0.25,"major_tick_line_color":"#5B5B5B","major_tick_out":3,"minor_tick_line_alpha":0.25,"minor_tick_line_color":"#5B5B5B","ticker":{"id":"57146"}},"id":"57145","type":"LinearAxis"},{"attributes":{"children":[{"id":"55964"},{"id":"55972"},{"id":"55966"},{"id":"55968"}]},"id":"55973","type":"Column"},{"attributes":{"child":{"id":"55973"},"title":"Vapour Pressure"},"id":"55974","type":"Panel"},{"attributes":{"axis_label":"$$\\psi \\text{ (cm)}$$","axis_label_standoff":10,"axis_label_text_color":"#5B5B5B","axis_label_text_font":"Calibri Light","axis_label_text_font_size":"1.15em","axis_label_text_font_style":"bold","axis_line_alpha":1,"axis_line_color":"#5B5B5B","coordinates":null,"formatter":{"id":"57178"},"group":null,"major_label_policy":{"id":"57179"},"major_label_text_color":"#5B5B5B","major_label_text_font":"Calibri Light","major_label_text_font_size":"0.95em","major_label_text_font_style":"bold","major_tick_in":0,"major_tick_line_alpha":0.25,"major_tick_line_color":"#5B5B5B","major_tick_out":3,"minor_tick_line_alpha":0.25,"minor_tick_line_color":"#5B5B5B","ticker":{"id":"57150"}},"id":"57149","type":"LinearAxis"},{"attributes":{"sizing_mode":"stretch_width","text":" \n        &lt;a name=\"Background\"&gt;&lt;h2&gt;Background&lt;/h2&gt;&lt;/a&gt;\n        &lt;p&gt;Reservoirs are constructed to provide (a) water supply and (b) protection against flood events. \n        &lt;/p&gt;\n        \n        &lt;h3&gt;The storage (governing) equation&lt;/h3&gt;\n        &lt;p&gt;The reservoir (level pool) flood routing method solves the finite difference form of the storage equation,&lt;br&gt;\n            $$\\quad \\frac{dS}{dt} \\approx \\frac{\\Delta S}{\\Delta t} = \\overline{I} - \\overline{O} $$ &lt;br&gt;\n            where $$S$$ is the volume of water in storage, dimensions $$[L^3]$$,\n            $$\\overline{I}$$ is the &lt;u&gt;average&lt;/u&gt; volumetric flow rate of water into the storage $$\\left(L^3/T\\right)$$ during the finite time interval $$\\Delta t$$ and \n            $$\\overline{O}$$ is the &lt;u&gt;average&lt;/u&gt; volumetric flow rate of water out of the storage $$\\left(L^3/T\\right)$$ during the finite time interval $$\\Delta t$$.\n        &lt;/p&gt;\n        &lt;p&gt;Expanding,&lt;br&gt;\n            $$\\quad \\frac{\\Delta S}{\\Delta t} = \\frac{S_{i+1}-S_i}{\\Delta t} = \\frac{I_{i+1}+I_i}{2} - \\frac{O_{i+1}+O_i}{2} $$ &lt;br&gt;\n            where $$i$$ is an integer time interval counter ($$i = 1,2,...,N$$ with $$N$$ the number of time intervals).\n        &lt;/p&gt;\n        &lt;p&gt;The inflow is known for all times and, after assuming an initial condition, all other qunatities at time $$t_i$$ are known then we solve for the unkowns at time $$t_{i+1}$$ which yields,&lt;br&gt;\n            $$\\quad G_{i+1} = I_{i+1} + I_i + G_i -2O_i $$, &lt;br&gt;\n            where &lt;br&gt;\n            $$\\quad G = \\frac{2S}{\\Delta t} + O$$ is known as the storage parameter.\n        &lt;/p&gt;\n        &lt;p&gt;Note that in order to step forward in time requires knoweledge of $$O_i$$ which is obtained via interpolation of a storage-discharge lookup table relating $$G$$ to $$O$$ based on the  physical characteristics of the reservoir.\n        &lt;/p&gt;\n\n        &lt;h3&gt;Storage-Discharge (H-S-O-G) lookup table&lt;/h3&gt;\n        The storage-discharge lookup table describes the physical characteristics of a reservoir and is therefore unique to the reservoir being analysed. &lt;br&gt;\n        In this interactive example, the lookup table for the (vertical walled) reservoir is developed based on the following equations for &lt;br&gt;\n            (a) the reservoir storage, &lt;br&gt;\n            $$\\quad S = AH \\quad (m^3)$$&lt;br&gt;\n            where $$A (m^2)$$ is the surface area of the reservoir and $$H (m)$$ is the water level in the reservoir and&lt;br&gt;\n            (b) the outflow discharge across the reservoir spillway $$(m^3/s)$$,&lt;br&gt;\n            $$\\quad O = C\\left(H-z_{spillway}\\right)^{1.5} \\quad (m^3/s) $$ for $$\\left(H-z_{spillway}\\right) &gt; 0 $$ &lt;br&gt;\n            $$\\quad O = 0 \\quad (m^3/s) $$ for $$\\left(H-z_{spillway}\\right) \\leq 0 $$ &lt;br&gt;\n            where $$C$$ is a discharge coefficient related to the size and shape of the spillway (weir) and $$z_{spillway}$$ is the elevation of the spillway crest such that $$H-z_{spillway}$$ is the height of water above the spillway crest.  \n        &lt;/p&gt;\n        "},"id":"58263","type":"Div"},{"attributes":{"line_alpha":0.2,"line_color":"grey","line_width":2,"x":{"field":"theta"},"y":{"field":"psi"}},"id":"57166","type":"Line"},{"attributes":{},"id":"58946","type":"Selection"},{"attributes":{},"id":"56730","type":"Selection"},{"attributes":{},"id":"56029","type":"BasicTicker"},{"attributes":{"button_type":"success","icon":null,"js_event_callbacks":{"button_click":[{"id":"58260"}]},"label":"Click to Restore Defaults","width":100},"id":"58259","type":"Button"},{"attributes":{"fill_alpha":{"value":0.1},"fill_color":{"value":"blue"},"hatch_alpha":{"value":0.1},"hatch_color":{"value":"blue"},"line_alpha":{"value":0.1},"line_color":{"value":"blue"},"x":{"field":"T"},"y":{"field":"z"}},"id":"56016","type":"Circle"},{"attributes":{},"id":"56729","type":"UnionRenderers"},{"attributes":{"axis_label":"$$e \\ 4SdAY2ZmZmbmJ0DoUbgehesnQG09Ctej8CdA8ihcj8L1J0B3FK5H4fonQPz//////ydA","dtype":"float64","order":"little","shape":[1191]}},"selected":{"id":"58757"},"selection_policy":{"id":"58756"}},"id":"57348","type":"ColumnDataSource"},{"attributes":{"child":{"id":"57291"},"title":"Unsaturated flow"},"id":"57292","type":"Panel"},{"attributes":{},"id":"57324","type":"DataRange1d"},{"attributes":{"children":[{"id":"57282"},{"id":"57059"},{"id":"57068"}],"width":350},"id":"57288","type":"Column"},{"attributes":{"line_color":"darkmagenta","line_width":2,"x":{"field":"e_kPa"},"y":{"field":"z"}},"id":"56083","type":"Line"},{"attributes":{"children":[{"id":"57287"},{"id":"57288"}],"sizing_mode":"scale_height"},"id":"57289","type":"Row"},{"attributes":{"coordinates":null,"data_source":{"id":"55978"},"glyph":{"id":"56066"},"group":null,"hover_glyph":null,"muted_glyph":{"id":"56068"},"nonselection_glyph":{"id":"56067"},"view":{"id":"56070"}},"id":"56069","type":"GlyphRenderer"},{"attributes":{"fill_color":{"value":"blue"},"hatch_color":{"value":"blue"},"line_color":{"value":"blue"},"x":{"field":"es_kPa"},"y":{"field":"z"}},"id":"56066","type":"Circle"},{"attributes":{"children":[{"id":"57285"},{"id":"57041"},{"id":"57044"},{"id":"57047"},{"id":"57048"},{"id":"57049"},{"id":"57050"},{"id":"57278"}]},"id":"57287","type":"Column"},{"attributes":{"fill_alpha":{"value":0.1},"fill_color":{"value":"blue"},"hatch_alpha":{"value":0.1},"hatch_color":{"value":"blue"},"line_alpha":{"value":0.1},"line_color":{"value":"blue"},"x":{"field":"es_kPa"},"y":{"field":"z"}},"id":"56067","type":"Circle"},{"attributes":{"children":[{"id":"57072"},{"id":"57136"},{"id":"57207"}],"sizing_mode":"scale_height"},"id":"57286","type":"Row"},{"attributes":{"source":{"id":"55978"}},"id":"56070","type":"CDSView"},{"attributes":{"fill_alpha":{"value":0.2},"fill_color":{"value":"blue"},"hatch_alpha":{"value":0.2},"hatch_color":{"value":"blue"},"line_alpha":{"value":0.2},"line_color":{"value":"blue"},"x":{"field":"es_kPa"},"y":{"field":"z"}},"id":"56068","type":"Circle"},{"attributes":{"children":[{"id":"57281"}],"sizing_mode":"stretch_width"},"id":"57290","type":"Row"},{"attributes":{"sizing_mode":"scale_height","text":"&lt;h1&gt;Groundwater: Darcy's Law (Unsaturated flow)&lt;/h1&gt;\n        &lt;p&gt;This applet examines unsaturated flow between two tensiometers arranged in a vertical array above the water table.&lt;/p&gt;\n\n        "},"id":"57280","type":"Div"},{"attributes":{"fill_color":{"value":null},"hatch_color":{"value":"darkmagenta"},"line_color":{"value":"darkmagenta"},"marker":{"value":"square"},"x":{"field":"e_kPa"},"y":{"field":"z"}},"id":"56101","type":"Scatter"},{"attributes":{"fill_alpha":{"value":0.2},"fill_color":{"value":"yellow"},"hatch_alpha":{"value":0.2},"line_alpha":{"value":0.2},"marker":{"value":"circle_dot"},"size":{"value":10},"x":{"field":"tPoint"},"y":{"field":"yPoints"}},"id":"57958","type":"Scatter"},{"attributes":{"source":{"id":"57954"}},"id":"57960","type":"CDSView"},{"attributes":{"height":5,"sizing_mode":"scale_height","style":{"font-size":"80%"},"text":"&lt;p&gt;&lt;img src=\"images/copyright-symbol.png\" alt=\"Copyright\" width=\"10\"&gt; 2022, Dr Nick Cartwright, Griffith University&lt;/p&gt;"},"id":"57283","type":"Div"},{"attributes":{"sizing_mode":"stretch_width","text":"&lt;h2&gt;Background&lt;/h2&gt;\n        \n        &lt;h3&gt;The unsaturated zone&lt;/h3&gt;\n        &lt;p&gt;The unsaturated zone existis above the watertable in an unconfined aquifer. In this zone, the pore spaces contain a mix of air and water, as opposed to the saturated zone where pores are filled with water only. \n        The water (or moisture) in this zone exists due to capillary suction forces \"sucking\" water up from the saturated zone. Hence, the pore water pressure here is negative. \n        In addition, the hydraulic conductivity (the measure of how easily water flows through the soil) is a strongly decreasing function of moisture content due to the additional work required by the water to displace the air.\n        &lt;/p&gt;\n        \n        &lt;h3&gt;Darcy's law&lt;/h3&gt;\n        &lt;p&gt;Darcy's law also applies in the unsatuarted zone with the following two special considerations &lt;br&gt;\n            &lt;ol&gt;\n                &lt;li&gt;the pore water pressure $$p$$ (and hence pressure head $$\\psi = p/\\rho g$$) is negative and &lt;/li&gt;\n                &lt;li&gt;the hydraulic conductivity is non-linearly dependent on the moisture content $$K=K\\left(\\theta\\right)$$&lt;/li&gt;\n            &lt;/ol&gt;\n        &lt;p&gt;\n        &lt;p&gt;Darcy's law is therefore written as, &lt;br&gt;\n            $$\\quad q = -K\\left(\\theta\\right)\\nabla h \\quad [L/T]$$ &lt;br&gt;\n            where \n            $$q$$ is known as Darcy's flux which represents the flow per unit area $$\\left(Q/A\\right)$$, \n            $$K\\left(\\theta\\right)$$ is the hydraulic conductivity $$[L/T]$$ and &lt;br&gt;\n            $$\\quad \\nabla h = \\left( \\frac{\\partial h}{\\partial x} + \\frac{\\partial h}{\\partial y} + \\frac{\\partial h}{\\partial z} \\right) $$ is the pizometric head gradient &lt;br&gt;\n            with the piezometric head, &lt;br&gt;\n            $$\\quad h = z + \\psi$$\n        &lt;/p&gt;\n\n        &lt;h3&gt;Moisture retention curves&lt;/h3&gt;\n        &lt;p&gt;There are many different functions to describe the soil mositure characteristics of various soil types. \n           One of the more widely used (and the one used here) are the following &lt;b&gt;van Genuchten (1980)&lt;/b&gt; formulae.\n        &lt;/p&gt;\n        &lt;p&gt;The moisture content is given by, &lt;br&gt;\n            $$\\quad \\theta \\left(\\psi\\right) = \\theta_r + \\frac{ \\theta_s - \\theta_r }{(1+|\\alpha \\psi|^\\beta)^m}$$ for $$\\psi &lt; 0$$ &lt;br&gt;\n            $$\\quad \\theta \\left(\\psi\\right) = \\theta_s$$ for $$\\psi \\geq 0$$ &lt;br&gt;\n            where &lt;br&gt;\n            $$\\qquad \\psi$$ is the pore water pressure ($$\\psi&lt;0$$ in the unsaturated zone) &lt;br&gt;\n            $$\\qquad \\theta_r $$ is the residual mositure content &lt;br&gt;\n            $$\\qquad \\theta_s $$ is the saturated mositure content &lt;br&gt;\n            $$\\qquad m = 1 - 1/\\beta$$ is a fitting parameter.&lt;br&gt;\n            and $$\\alpha$$ and $$\\beta$$ are empirical fitting parameters unique to the soil type.\n            The parameters provided in the soil selection part of the applet have been sourced from the \n            &lt;a href=\"http://www.pc-progress.com/en/OnlineHelp/HYDRUS3/Hydrus.html?WaterFlowParameters.html\" target=\"_blank\"&gt;Hydrus3D manual&lt;/a&gt;.\n        &lt;/p&gt;\n\n        &lt;p&gt;The hydraulic conductivity is given by, &lt;br&gt;\n            $$\\quad K\\left(\\theta\\right) = K_s S_e \\left[1 - \\left(1 - S_e^{1/m}\\right)^m\\right]^2 $$ &lt;br&gt;\n            were $$K_s$$ is the saturated hydraulic conductivity and $$S_e$$ is the effective saturation, &lt;br&gt; \n            $$\\quad S_e = \\frac{ \\theta - \\theta_r}{ \\theta_s - \\theta_r}$$\n        &lt;/p&gt;\n\n                    ","width":400},"id":"57281","type":"Div"},{"attributes":{"button_type":"success","icon":null,"js_event_callbacks":{"button_click":[{"id":"57279"}]},"label":"Click to Restore Defaults","width":100},"id":"57278","type":"Button"},{"attributes":{"text":"&lt;h2&gt;User Input Controls&lt;/h2&gt;\n                             &lt;p&gt;Move sliders to adjust input parameter values.&lt;br&gt;\n                             &lt;i&gt;&lt;span style=\"color: #ff0000\"&gt;&lt;b&gt;&lt;u&gt;Tip:&lt;/b&gt;&lt;/u&gt;&lt;/span&gt; Click slider and then use left/right arrows on keyboard for greater control.&lt;/i&gt;\n                             &lt;/p&gt;"},"id":"57285","type":"Div"},{"attributes":{"fill_color":{"value":"yellow"},"marker":{"value":"circle_dot"},"size":{"value":10},"x":{"field":"Hpt"},"y":{"field":"Opt"}},"id":"58021","type":"Scatter"},{"attributes":{"text":"&lt;h2&gt;Computed Parameters&lt;/h2&gt;"},"id":"57282","type":"Div"},{"attributes":{"args":{"SoilTypeSelection":{"id":"57041"},"slider_psi1":{"id":"57049"},"slider_psi2":{"id":"57050"},"slider_z1":{"id":"57047"},"slider_z2":{"id":"57048"},"sourceSoilProperties_ALL":{"id":"57039"},"sourceSoilProperties_SELECTED":{"id":"57040"},"source_InputParameters":{"id":"57038"}},"code":"\n                                     \n                                    // sliders ///////////////////////////\n                                    slider_z1.value = source_InputParameters.data['Value'][0];\n                                    slider_z2.value = source_InputParameters.data['Value'][1];\n                                    slider_psi1.value = source_InputParameters.data['Value'][2];\n                                    slider_psi2.value = source_InputParameters.data['Value'][3];\n\n                                    // soil type selection ///////////////\n                                    const Parameter = ['theta_r', 'theta_s', 'alpha (1/cm)', 'beta', 'Ks (cm/d)'];\n                                    var SoilType = sourceSoilProperties_ALL.data['Soil Type'];\n                                    var ind = SoilType.indexOf('Sand');\n                                    for (var i = 0; i &lt; Parameter.length; i++) {\n                                        sourceSoilProperties_SELECTED.data['Value'][i] = sourceSoilProperties_ALL.data[Parameter[i]][ind];\n                                    }\n                                    sourceSoilProperties_SELECTED.change.emit();\n                                    SoilTypeSelection.value = 'Sand'\n                                    \n                                    "},"id":"57279","type":"CustomJS"},{"attributes":{"coordinates":null,"group":null,"text":"Copyright 2022, Dr Nick Cartwright, Griffith University","text_alpha":0.5,"text_font_size":"10px","x":0,"y":-1},"id":"57949","type":"Label"},{"attributes":{"args":{"sourceSoilProperties_ALL":{"id":"57039"},"sourceSoilProperties_SELECTED":{"id":"57040"}},"code":"\n                                 // selection /////////////////////\n                                 const Parameter = ['theta_r', 'theta_s', 'alpha (1/cm)', 'beta', 'Ks (cm/d)'];\n                                 var SoilType = sourceSoilProperties_ALL.data['Soil Type'];\n                                 var ind = SoilType.indexOf(cb_obj.value);\n                                 for (var i = 0; i &lt; Parameter.length; i++) {\n                                     sourceSoilProperties_SELECTED.data['Value'][i] = sourceSoilProperties_ALL.data[Parameter[i]][ind];\n                                 }\n                                 sourceSoilProperties_SELECTED.change.emit();\n                            "},"id":"57276","type":"CustomJS"},{"attributes":{"callback":null,"names":["HG"],"tooltips":[["Time (h)","@t"],["Inflow, I (m^3/s)","@I{0.2f}"],["Outflow, O (m^3/s)","@O{0.2f}"],["Water level, H (m)","@H{0.2f}"],["Storage, S (m^3)","@S{0.2f}"]]},"id":"57952","type":"HoverTool"},{"attributes":{},"id":"57340","type":"WheelZoomTool"},{"attributes":{"fill_alpha":{"value":0.1},"fill_color":{"value":"yellow"},"hatch_alpha":{"value":0.1},"line_alpha":{"value":0.1},"marker":{"value":"circle_dot"},"size":{"value":10},"x":{"field":"tPoint"},"y":{"field":"yPoints"}},"id":"57957","type":"Scatter"},{"attributes":{"coordinates":null,"group":null,"source":{"id":"57071"},"text":{"field":"label"},"text_color":{"field":"color"},"text_font_size":{"value":"12px"},"x":{"field":"K"},"y":{"field":"psi"}},"id":"57273","type":"LabelSet"},{"attributes":{"coordinates":null,"data_source":{"id":"57954"},"glyph":{"id":"57956"},"group":null,"hover_glyph":null,"muted_glyph":{"id":"57958"},"nonselection_glyph":{"id":"57957"},"view":{"id":"57960"}},"id":"57959","type":"GlyphRenderer"},{"attributes":{"fill_alpha":{"value":0.1},"fill_color":{"value":"yellow"},"hatch_alpha":{"value":0.1},"line_alpha":{"value":0.1},"marker":{"value":"circle_dot"},"size":{"value":10},"x":{"field":"Hpt"},"y":{"field":"Opt"}},"id":"58022","type":"Scatter"},{"attributes":{"args":{"slider_psi1":{"id":"57049"},"slider_psi2":{"id":"57050"},"slider_z1":{"id":"57047"},"slider_z2":{"id":"57048"},"sourceSoilProperties_ALL":{"id":"57039"},"sourceSoilProperties_SELECTED":{"id":"57040"},"source_Labels":{"id":"57123"},"source_OutputTable":{"id":"57051"},"source_OutputTable_Results":{"id":"57062"},"source_Qarrow":{"id":"57127"},"source_ScatterPoints":{"id":"57071"},"source_VG_Curves":{"id":"57134"},"source_WT":{"id":"57135"}},"code":"\n                             \n                        // get slider values /////////////////////////////\n                        const z1 = slider_z1.value;\n                        const z2 = slider_z2.value;\n                        const psi1 = slider_psi1.value;\n                        const psi2 = slider_psi2.value;\n                        \n                        // get soil properties ///////////////////////////\n                        var theta_r = sourceSoilProperties_SELECTED.data['Value'][0];\n                        var theta_s = sourceSoilProperties_SELECTED.data['Value'][1];\n                        var alpha = sourceSoilProperties_SELECTED.data['Value'][2];\n                        var beta = sourceSoilProperties_SELECTED.data['Value'][3];\n                        var Ks = sourceSoilProperties_SELECTED.data['Value'][4];\n\n                        // van Genuchten function /////////////////////////////\n                        var theta, K, Se\n                        const m = 1 - 1/beta\n                        function getVanGenuchten(psi) {\n                            if (psi &lt; 0) {\n                                theta = theta_r + (theta_s - theta_r)/((1+Math.abs(alpha*psi)**beta)**m);\n                                Se = (theta - theta_r)/(theta_s - theta_r);\n                                K = Ks*Se*(1 - (1 - Se**(1/m))**m)**2;\n                                     }\n                            else {\n                                theta = theta_s;\n                                K = Ks;\n                                Se = 1;\n                                }\n                            return [theta, Se, K]\n                            }\n\n                        // calcs for points 1 and 2 ///////////////////////////\n                        const h1 = z1 + psi1;\n                        const h2 = z2 + psi2;\n                        const dh = h2-h1;\n                        const dhdz = (h2-h1)/(z2-z1);\n                        let VG1 = getVanGenuchten(psi1);\n                        const theta1 = VG1[0];\n                        const Se1 = VG1[1];\n                        const K1 = VG1[2];\n                        let VG2 = getVanGenuchten(psi2);\n                        const theta2 = VG2[0];\n                        const Se2 = VG2[1];\n                        const K2 = VG2[2];\n                        const Kavg = (K1+K2)/2;\n                        const q1 = -K1*dhdz;\n                        const q2 = -K2*dhdz;\n                        const qavg = -Kavg*dhdz;\n\n                        // update output data /////////////////////////////////\n                        \n                        source_OutputTable.data['At (1)'][0] = theta1.toFixed(4);\n                        source_OutputTable.data['At (1)'][1] = Se1.toFixed(4);\n                        source_OutputTable.data['At (1)'][2] = K1.toExponential(3);\n                        source_OutputTable.data['At (1)'][3] = h1.toFixed(2);\n\n                        source_OutputTable.data['At (2)'][0] = theta2.toFixed(4);\n                        source_OutputTable.data['At (2)'][1] = Se2.toFixed(4);\n                        source_OutputTable.data['At (2)'][2] = K2.toExponential(3);\n                        source_OutputTable.data['At (2)'][3] = h2.toFixed(2);\n                        source_OutputTable.change.emit();\n                        console.log(h1,h2)\n                        \n                        source_OutputTable_Results.data['Value'][0] = Kavg.toExponential(3);\n                        source_OutputTable_Results.data['Value'][1] = dh.toFixed(2);\n                        source_OutputTable_Results.data['Value'][2] = dhdz.toFixed(4);\n                        source_OutputTable_Results.data['Value'][3] = qavg.toExponential(3);\n                        source_OutputTable_Results.change.emit();\n                        \n                        // update scatter points\n                        source_ScatterPoints.data['psi'] = [psi1,psi2];\n                        source_ScatterPoints.data['theta'] = [theta1,theta2];\n                        source_ScatterPoints.data['K'] = [K1,K2];\n                        source_ScatterPoints.data['z'] = [z1,z2];\n                        source_ScatterPoints.data['h'] = [h1,h2];\n                        var string1 = '(' + theta1.toFixed(3).toString() + ', ' + psi1.toFixed(2).toString() + ')';\n                        var string2 = '(' + theta2.toFixed(3).toString() + ', ' + psi2.toFixed(2).toString() + ')';\n                        source_ScatterPoints.data['label_theta'] = [string1, string2]\n                        var string1 = '(' + K1.toExponential(3).toString() + ', ' + psi1.toFixed(2).toString() + ')';\n                        var string2 = '(' + K2.toExponential(3).toString() + ', ' + psi2.toFixed(2).toString() + ')';\n                        source_ScatterPoints.data['label_K'] = [string1, string2]\n                        \n                        source_ScatterPoints.change.emit();\n                        \n                        // update scatter point labels\n                        //source_Labels.data['label'] = ['Datum, z=0','z1 = '+z1.toFixed(1).toString()+'cm, psi1 = '+psi1.toFixed(1).toString()+'cm','z2 = '+z2.toFixed(1).toString()+'cm, psi2 = '+psi2.toFixed(1).toString()+'cm','h1 = '+h1.toFixed(1).toString()+'cm','h2 = '+h2.toFixed(1).toString()+'cm']\n                        source_Labels.data['y'] = [0,z1,z2,h1,h2]\n                        source_Labels.change.emit();\n\n                        // compute vg curves //////////////////////////////////\n                        const psi = source_VG_Curves.data['psi'];\n                        for (var ii = 0; ii &lt; psi.length; ii++) {\n                            let VG = getVanGenuchten(psi[ii])\n                            source_VG_Curves.data['theta'][ii] = VG[0];\n                            source_VG_Curves.data['Se'][ii] = VG[1];\n                            source_VG_Curves.data['K'][ii] = VG[2];\n                            source_VG_Curves.data['theta_r'][ii] = theta_r;\n                            source_VG_Curves.data['theta_s'][ii] = theta_s;\n                            source_VG_Curves.data['Ks'][ii] = Ks;\n                                }\n                        source_VG_Curves.change.emit();\n                        \n                        // update WT data /////////////////////////////////////\n                        source_WT.data['theta'] = [source_VG_Curves.data['theta'][0], source_VG_Curves.data['theta'][psi.length-1]];\n                        source_WT.data['K'] = [source_VG_Curves.data['K'][0], source_VG_Curves.data['K'][psi.length-1]];\n                        source_WT.change.emit();\n                        \n                        // update Q arrow /////////////////////////////////////\n                        var Qstart, Qend\n                        var dhABS = Math.abs(h1-h2)\n                        console.log(h1,h2,dhABS)\n                        if (h1 &gt; h2){\n                            console.log('here1',h1,h2)\n                            Qstart = (z1+z2)/2 - dhABS/2 \n                            Qend = (z1+z2)/2 + dhABS/2\n                            source_Qarrow.data['txt'] = ['q',]\n                            }\n                        else if (h2 &gt; h1) {\n                            console.log('here2')\n                            Qend = (z1+z2)/2 - dhABS/2 \n                            Qstart = (z1+z2)/2 + dhABS/2\n                            source_Qarrow.data['txt'] = ['q',]\n                            }\n                        else {\n                            Qstart = NaN\n                            Qend = NaN\n                            source_Qarrow.data['txt'] = ['q = 0',]\n                            }\n                        source_Qarrow.data['z_start'] = [Qstart,]\n                        source_Qarrow.data['z_end'] = [Qend,]\n                        source_Qarrow.data['z_txt'] = [(z1+z2)/2,]\n                        source_Qarrow.change.emit();\n                        \n                        "},"id":"57277","type":"CustomJS"},{"attributes":{"source":{"id":"57071"}},"id":"57272","type":"CDSView"},{"attributes":{"coordinates":null,"data_source":{"id":"57071"},"glyph":{"id":"57268"},"group":null,"hover_glyph":null,"muted_glyph":{"id":"57270"},"nonselection_glyph":{"id":"57269"},"view":{"id":"57272"}},"id":"57271","type":"GlyphRenderer"},{"attributes":{"coordinates":null,"group":null,"text_color":"#5B5B5B","text_font":"Calibri Light","text_font_size":"1.25em","text_font_style":"bold"},"id":"56149","type":"Title"},{"attributes":{},"id":"57341","type":"ResetTool"},{"attributes":{"fill_color":{"field":"color"},"marker":{"value":"circle_dot"},"size":{"value":12},"x":{"field":"K"},"y":{"field":"psi"}},"id":"57268","type":"Scatter"},{"attributes":{"line_alpha":0.1,"line_color":"darkmagenta","line_width":2,"x":{"field":"e_kPa"},"y":{"field":"z"}},"id":"56084","type":"Line"},{"attributes":{"fill_alpha":{"value":0.1},"fill_color":{"field":"color"},"hatch_alpha":{"value":0.1},"line_alpha":{"value":0.1},"marker":{"value":"circle_dot"},"size":{"value":12},"x":{"field":"K"},"y":{"field":"psi"}},"id":"57269","type":"Scatter"},{"attributes":{"coordinates":null,"data_source":{"id":"55978"},"glyph":{"id":"56083"},"group" tributes":{},"id":"58987","type":"UnionRenderers"},{"attributes":{},"id":"58982","type":"Selection"},{"attributes":{},"id":"58985","type":"UnionRenderers"},{"attributes":{"coordinates":null,"group":null,"text_color":"#5B5B5B","text_font":"Calibri Light","text_font_size":"1.25em","text_font_style":"bold"},"id":"56052","type":"Title"},{"attributes":{},"id":"59013","type":"Selection"},{"attributes":{},"id":"58981","type":"UnionRenderers"},{"attributes":{},"id":"58988","type":"Selection"},{"attributes":{},"id":"56056","type":"AllLabels"},{"attributes":{},"id":"56058","type":"BasicTickFormatter"},{"attributes":{},"id":"58983","type":"UnionRenderers"},{"attributes":{},"id":"56059","type":"AllLabels"},{"attributes":{},"id":"58986","type":"Selection"},{"attributes":{},"id":"58990","type":"Selection"},{"attributes":{},"id":"56243","type":"AllLabels"},{"attributes":{"line_alpha":0.2,"line_color":"blue","line_width":2,"x":{"field":"es_kPa"},"y":{"field":"z"}},"id":"56049","type":"Line"},{"attributes":{},"id":"58980","type":"Selection"},{"attributes":{},"id":"56055","type":"BasicTickFormatter"},{"attributes":{"label":{"value":"es"},"renderers":[{"id":"56050"},{"id":"56069"}]},"id":"56064","type":"LegendItem"},{"attributes":{},"id":"58984","type":"Selection"},{"attributes":{"children":[{"id":"55850"}],"sizing_mode":"stretch_both"},"id":"55853","type":"Column"},{"attributes":{},"id":"58979","type":"UnionRenderers"},{"attributes":{"coordinates":null,"data_source":{"id":"56712"},"glyph":{"id":"56747"},"group":null,"hover_glyph":null,"muted_glyph":{"id":"56749"},"nonselection_glyph":{"id":"56748"},"view":{"id":"56751"}},"id":"56750","type":"GlyphRenderer"},{"attributes":{"sizing_mode":"stretch_both","text":"\n               &lt;div class=\"loader\"&gt;&lt;/div&gt;\n               &lt;h1&gt;An (Interactive) Introduction to Hydrology&lt;/h1&gt;\n               &lt;meta name=\"viewport\" content=\"width=device-width, initial-scale=1.0\"&gt;\n               \n               &lt;p&gt;&lt;img src=\"images/HydrologicCycle2.png\" alt=\"HydrologicCycle\" width=\"800\"&gt;&lt;/p&gt;\n               \n               &lt;p&gt;These pages provide an Interactive Introduction to Hydrology using calculation applets to explore a range of processes associated with the Hydrological Cycle and other applied hydrology methods such as flood routing and flood frequency analysis.&lt;/p&gt;\n\n               &lt;p&gt;The topics available via the tabs above are:&lt;/p&gt;\n\n               &lt;ol&gt;\n                   &lt;li&gt;&lt;b&gt;Water Vapour:&lt;/b&gt;&lt;/li&gt;\n                   &lt;ol type='a'&gt;\n                       &lt;li&gt;Vapour pressure: the relationship between partial pressure due to water vapour, relative humidity and the density of water vapour in the air.&lt;/li&gt;\n                       &lt;li&gt;Precipitable water: estimation of the amount of water (vapour) in the troposphere&lt;/li&gt;\n                   &lt;/ol&gt;\n                   \n                   &lt;li&gt;&lt;b&gt;Evaporation:&lt;/b&gt;&lt;/li&gt;\n                   &lt;ol type='a'&gt;\n                       &lt;li&gt;Potential evaporation rates: the energy balance, aerodynamic and combined methods&lt;/li&gt;\n                   &lt;/ol&gt;\n                   \n                   &lt;li&gt;&lt;b&gt;Groundwater:&lt;/b&gt; &lt;/li&gt;\n                   &lt;ol type='a'&gt;\n                       &lt;li&gt; saturated flow: application of Darcy's law to horizontal flow in the saturated zone&lt;/li&gt;\n                       &lt;li&gt; unsaturated flow: application of Darcy's law to vertical flow in the unsaturated zone&lt;/li&gt;\n                   &lt;/ol&gt;\n                  \n                   &lt;li&gt;&lt;b&gt;Infiltration and runoff generation:&lt;/b&gt;&lt;/li&gt;\n                   &lt;ol type='a'&gt;\n                       &lt;li&gt;the Green and Ampt infiltration equations and the relationship between rainfall, infiltration and surface runoff generation&lt;/li&gt;\n                   &lt;/ol&gt;\n                   \n                   &lt;li&gt;&lt;b&gt;Surface Flow:&lt;/b&gt; &lt;/li&gt;\n                   &lt;ol type='a'&gt;\n                      &lt;li&gt;Overland Flow: the (laminar) overland surface flow equations&lt;/li&gt;\n                   &lt;/ol&gt;\n\n                   &lt;li&gt;&lt;b&gt;Flood Frequency Analysis:&lt;/b&gt; &lt;/li&gt;\n                   &lt;ol type='a'&gt;\n                      &lt;li&gt;the extreme value and log Pearson type III distributions&lt;/li&gt;\n                    &lt;/ol&gt;\n\n                   &lt;li&gt;&lt;b&gt;Flood Routing:&lt;/b&gt; &lt;/li&gt;\n                   &lt;ol type='a'&gt;\n                       &lt;li&gt;Reservoir flood routing via the level pool flood routing method&lt;/li&gt;\n                       &lt;li&gt;River flood routing via the Muskingum flood routing method&lt;/li&gt;\n                   &lt;/ol&gt;\n\n                &lt;/ol&gt;\n                \n                &lt;h3&gt;Recommended Supporting Reference&lt;/h3&gt;\n                &lt;p&gt;Chow, V.T., Maidment, D.R., Mays, L.W., 1988. Applied Hydrology. McGraw-Hill, 571 pp.&lt;/p&gt;\n\n                &lt;h3&gt;Development&lt;/h3&gt;\n                &lt;p&gt;These applets have been developed by Dr Nick Cartwright as part of the learning and teaching resources for 2004ENG Hydrology and 7418ENG Engineering Hydrology at &lt;a href=\"https://www.griffith.edu.au/\" target=\"_blank\"&gt;Griffith University&lt;/a&gt;, Gold Coast, Australia.&lt;/p&gt;\n                &lt;p&gt;Applets developed using &lt;a href=\"https://www.python.org/\" target=target=\"_blank\"&gt;python (3.9.12)&lt;/a&gt; and  \n                &lt;a href=\"https://docs.bokeh.org/en/2.4.2/\" target=\"_blank\"&gt;bokeh (2.4.2)&lt;/a&gt;. &lt;br&gt;\n                Tested using &lt;a href=\"https://www.google.com.au/intl/en_au/chrome/\" target=\"_blank\"&gt;chrome (Version 100.0.4896.75, 64-bit)&lt;/a&gt; \n                &lt;/p&gt;\n\n                &lt;h3&gt;Feedback&lt;/h3&gt;\n                &lt;p&gt;Please send any feedback or bug issues to Nick via email: n-&lt;i&gt;dot&lt;/i&gt;-cartwright-&lt;i&gt;at&lt;/i&gt;-griffith.edu.au.&lt;/p&gt;\n\n                &lt;h3&gt;Acknowledgements&lt;/h3&gt;\n                &lt;p&gt;These hydrology calculation applets have been inspired by &lt;a href=\"https://www.linkedin.com/in/robert-dalrymple-6111a06/\" target=\"_blank\"&gt;Professor Robert A. Dalrymple's&lt;/a&gt; coastal engineering &lt;a href=\"https://www.oc.nps.edu/~chu/UDapplets/\" target=\"_blank\"&gt;calculation applets&lt;/a&gt; which were developed in the mid to late 1990's.&lt;/p&gt;\n\n                &lt;h3&gt;Citation&lt;/h3&gt;\n                &lt;p&gt;Cartwright, N. (2022) An (Interactive) Introduction to Hydrology: Calculation Applets, &lt;a href = \"https://ensea00.github.io/Hydrology/HydrologyApplets.html\"&gt;https://ensea00.github.io/Hydrology/HydrologyApplets.html &lt;/a&gt;&lt;/p&gt;\n\n                &lt;h3&gt;Disclaimer&lt;/h3&gt;\n                &lt;p&gt;These calculation applets have been developed for teaching purposes only. Use them for other applications at your own risk.&lt;/p&gt;\n                \n                &lt;h3&gt;Copyright&lt;/h3&gt;\n                &lt;p style='font-size':'60%';&gt;This work by Nick Cartwright is licensed under a &lt;a href=\"https://creativecommons.org/licenses/by-nc-nd/4.0/\" target=\"_blank\"&gt;Creative Commons Attribution-NonCommercial-NoDerivatives 4.0 International License&lt;/a&gt;&lt;/p&gt;\n                &lt;p&gt;&lt;a href=\"https://creativecommons.org/licenses/by-nc-nd/4.0/\" target=\"_blank\"&gt;&lt;img src=\"images/by-nc-nd.png\" alt=\"Creative Commons\" width=\"100\"&gt;&lt;/a&gt;&lt;/p&gt;\n\n                "},"id":"55850","type":"Div"},{"attributes":{"coordinates":null,"end":{"id":"56762"},"group":null,"line_color":{"value":"blue"},"line_width":{"value":4},"source":{"id":"56761"},"start":null,"x_end": field":"xAxis"},"y":{"field":"yAxis"}},"id":"57395","type":"Line"},{"attributes":{"text":"&lt;h2&gt;User Input Controls&lt;/h2&gt;\n                             &lt;p&gt;Move sliders to adjust input parameter values.&lt;br&gt;\n                             &lt;i&gt;&lt;span style=\"color: #ff0000\"&gt;&lt;b&gt;&lt;u&gt;Tip:&lt;/b&gt;&lt;/u&gt;&lt;/span&gt; Click slider and then use left/right arrows on keyboard for greater control.&lt;/i&gt;\n                             &lt;/p&gt;"},"id":"57440","type":"Div"},{"attributes":{"label":{"value":"R (cm)"},"renderers":[{"id":"57360"}]},"id":"57423","type":"LegendItem"},{"attributes":{"text":"&lt;h1&gt;Infiltration - Green and Ampt Model&lt;/h1&gt;\n                   &lt;p&gt;This applet examines the relationship between rainfall, infiltration and runoff generation using the Green-Ampt infiltration equations.&lt;br&gt;\n                   &lt;i&gt;Further details and the equations can be found in the &lt;b&gt;&lt;a href=\"#Background\"&gt;Background&lt;/a&gt;&lt;/b&gt; section below.&lt;/i&gt;&lt;/p&gt;\n                   &lt;/p&gt;"},"id":"57435","type":"Div"},{"attributes":{"line_alpha":0.2,"x":{"field":"x"},"y":{"field":"y"}},"id":"57407","type":"Line"},{"attributes":{"coordinates":null,"data_source":{"id":"57318"},"glyph":{"id":"57399"},"group":null,"hover_glyph":null,"muted_glyph":{"id":"57401"},"nonselection_glyph":{"id":"57400"},"view":{"id":"57403"}},"id":"57402","type":"GlyphRenderer"},{"attributes":{"coordinates":null,"data_source":{"id":"57404"},"glyph":{"id":"57405"},"group":null,"hover_glyph":null,"muted_glyph":{"id":"57407"},"nonselection_glyph":{"id":"57406"},"view":{"id":"57409"}},"id":"57408","type":"GlyphRenderer"},{"attributes":{"text":"\n        \n        &lt;a name=\"Background\"&gt;&lt;h2&gt;Background&lt;/h2&gt;&lt;/a&gt;\n\n        &lt;h3&gt;Definitions&lt;/h3&gt;\n        \n        &lt;p&gt;Infiltration is the movement of water across the ground surface in to the subsurface.&lt;/p&gt;\n        &lt;p&gt;The (actual) infiltration rate ($$f$$) is the amount of infiltrated water per unit time. It depends on the rainfall rate and the hydraulic properties of the soil (porosity, conductivity and initial moisture content). Dimensions: $$[L/T]$$ and typical units: $$(mm/h)$$.&lt;/p&gt;\n        &lt;p&gt;The infiltration capacity ($$f_c$$) is the &lt;u&gt;maximum&lt;/u&gt; infiltration rate for a particular soil type (ie. the rainfall rate is not limiting the process). It can also be thought of as a &lt;u&gt;potential&lt;/u&gt; infiltration rate. Dimensions: $$[L/T]$$ and typical units: $$(mm/h)$$. It depends &lt;u&gt;only&lt;/u&gt; on the hydraulic properties of the soil.&lt;/p&gt;\n        &lt;p&gt;The actual infiltration rate will be less than for equal to the infiltration capacity depending on the rainfall rate $$i$$ relative to the infiltration capacity. If $$i \\geq f_c$$ then $$f = f_c$$, if $$i &lt; f_c$$ then $$f = i$$.&lt;/p&gt; \n\n        &lt;p&gt;The cumulative infiltration amount $$F$$ is the amount of water $$[L]$$ that has infiltrated up to time $$t$$. \n        It is the time integral of the infiltration rate $$f$$, &lt;br&gt;\n        $$\\quad F = \\int_0^t \\! f \\, \\mathrm{d}t$$ &lt;br&gt;\n        Conversely, the infiltration rate is the time derivative of the cumulative infiltration amount, &lt;br&gt;\n        $$\\quad f = \\frac{\\partial F}{\\partial t} $$\n        &lt;/p&gt;\n        \n        &lt;h3&gt;The Green and Ampt infiltration equations&lt;/h3&gt;\n\n        &lt;p&gt;\n        &lt;img src=\"images/GreenAndAmpt_Assumptions.png\" alt=\"GreenAndAmpt\", align-'center', height=350&gt;\n        &lt;img src=\"images/GreenAndAmpt.png\" alt=\"GreenAndAmpt\", align-'center', height=350&gt;\n        &lt;/p&gt;\n\n        &lt;p&gt;The Green-Ampt infiltration equations are derived under the following simplifying assumptions, &lt;/p&gt;\n        \n        &lt;ul&gt;\n            &lt;li&gt;the initial moisture distribution is uniform with depth, $$\\theta (z) = \\theta_i$$ &lt;/li&gt;\n            &lt;li&gt;water is continuously ponded at the surface, i.e. the surface is always saturated &lt;/li&gt;\n            &lt;li&gt;the wetting front is a sharp interface between the initial moisture condition below and saturated conditions above&lt;/li&gt;\n            &lt;li&gt;the hydraulic conductivity behind the wetting front is constant and equal to the saturated value $$K_s$$&lt;/li&gt;\n        &lt;/ul&gt;\n\n        &lt;p&gt;The Green and Ampt infiltration capacity is given by, &lt;br&gt;\n            $$\\quad f_c = K_s\\left(1 + \\frac{N_s}{F} \\right) \\quad [L/T]$$ &lt;br&gt;\n            where $$K_s$$ is the saturated hydraulic conductivity $$[L/T]$$ and $$N_s$$ is the effective matrix potential given by, &lt;br&gt;\n            $$\\quad N_s = |\\psi|\\Delta\\theta = \\psi \\left(\\theta_s - \\theta_i \\right) \\quad [L]$$ &lt;br&gt;\n            with $$\\psi$$ the wetting front soil suction head $$[L]$$, $$\\theta_s$$ is the saturated moisture content $$\\left(vol/vol\\right)$$ and $$\\theta_i$$ is the initial moisture content $$\\left(vol/vol\\right)$$\n        &lt;/p&gt;\n\n        &lt;p&gt;The Green and Ampt cumulative infiltration amount is given by, &lt;br&gt;\n            $$\\quad F = F_p + K_s \\left(t-t_p \\right) + N_s \\ln \\left(\\frac{N_s+F}{N_s+F_p} \\right) = L\\Delta\\theta = L\\left(\\theta_s - \\theta_i \\right) \\quad [L]$$ &lt;br&gt;\n            where $$F_p = it_p \\quad [L]$$ is the cumulative infiltration amount at the time of ponding $$t_p$$ given by, &lt;br&gt;\n            $$\\quad t_p = \\frac{K_sN_s}{i\\left(i-K_s\\right)} \\quad [T] $$ &lt;br&gt;\n            with $$i$$ the rainfall rate $$[L/T]$$. \n         &lt;/p&gt;\n\n        &lt;h3&gt;Surface runoff generation&lt;/h3&gt;\n        &lt;p&gt;The runoff rate (and amount) is determined via the conservation of mass principle for steady flow which states that &lt;br&gt;\n            $$\\quad Inflow = Outflow$$ &lt;br&gt;\n            For the system being considered here, &lt;br&gt;\n            $$\\quad Inflow = Rainfall$$ &lt;br&gt;\n            and &lt;br&gt;\n            $$\\quad Outflow = Infiltration + Runoff$$ &lt;br&gt;\n            therefore we have &lt;br&gt;\n            $$\\quad Rainfall = Infiltration + Runoff$$.\n        &lt;/p&gt;\n        &lt;p&gt;In terms of rates we have: &lt;br&gt;\n            $$\\quad i = f + r$$ so therefore, $$r = i - f$$. \n        &lt;/p&gt;\n        &lt;p&gt;In terms of amounts we have&lt;br&gt;\n            $$\\quad I = F + R$$ so therefore, $$R = I - F$$.\n        &lt;/p&gt;\n                    "},"id":"57436","type":"Div"},{"attributes":{"source":{"id":"57318"}},"id":"57403","type":"CDSView"},{"attributes":{"children":[{"id":"57437"},{"id":"57310"}],"width":400},"id":"57442","type":"Column"},{"attributes":{"fill_alpha":{"value":0.2},"fill_color":{"value":null},"hatch_alpha":{"value":0.2},"line_alpha":{"value":0.2},"size":{"value":10},"x":{"field":"xAxis"},"y":{"field":"yAxis"}},"id":"57401","type":"Circle"},{"attributes":{},"id":"55935","type":"BasicTickFormatter"},{"attributes":{"editor":{"id":"59048"},"field":"Value","formatter":{"id":"57454"},"title":"Value","width":80},"id":"57457","type":"TableColumn"},{"attributes":{"data":{"x":[0,11.999999999999993],"y":[0,0]},"selected":{"id":"58765"},"selection_policy":{"id":"58764"}},"id":"57404","type":"ColumnDataSource"},{"attributes":{"source":{"id":"57348"}},"id":"57367","type":"CDSView"},{"attributes":{"line_dash":[6],"x":{"field":"xProfile"},"y":{"field":"K"}},"id":"57411","type":"Line"},{"attributes":{"fill_alpha":0.3,"fill_color":"green","hatch_alpha":0.3,"line_alpha":0.3,"line_color":"green","x":{"field":"x"},"y":{"field":"F"}},"id":"57351","type":"Patch"},{"attributes":{},"id":"55936","type":"AllLabels"},{"attributes":{"source":{"id":"57404"}},"id":"57409","type":"CDSView"},{"attributes":{"coordinates":null,"data_source":{"id":"57348"},"glyph":{"id":"57363"},"group":null,"hover_glyph":null,"m
