allbacks":{"change:value":[{"id":"57431"},{"id":"57432"}]},"options":["Sand","Loamy sand","Sandy loam","Loam","Silt loam","Sand clay loam","Clay loam","Silty clay loam","Sandy clay","Silty clay","Clay"],"title":"Select soil type","value":"Sand","width":250},"id":"57298","type":"Select"},{"attributes":{"bottom_units":"screen","coordinates":null,"fill_alpha":0.5,"fill_color":"lightgrey","group":null,"left_units":"screen","level":"overlay","line_alpha":1.0,"line_color":"black","line_dash":[4,4],"line_width":2,"right_units":"screen","syncable":false,"top_units":"screen"},"id":"58511","type":"BoxAnnotation"},{"attributes":{"bottom_units":"screen","coordinates":null,"fill_alpha":0.5,"fill_color":"lightgrey","group":null,"left_units":"screen","level":"overlay","line_alpha":1.0,"line_color":"black","line_dash":[4,4],"line_width":2,"right_units":"screen","syncable":false,"top_units":"screen"},"id":"58581","type":"BoxAnnotation"},{"attributes":{"data":{"color":["blue","green","red"],"index":[0,1,2],"xPoint":[36,36,36],"yPoint":{"__ndarray__":"T1yAyxRGGkA+aG38CXk2QHuDfB0idCRA","dtype":"float64","order":"little","shape":[3]}},"selected":{"id":"58994"},"selection_policy":{"id":"58993"}},"id":"56528","type":"ColumnDataSource"},{"attributes":{"line_alpha":0.2,"line_color":"green","line_width":2,"x":{"field":"t"},"y":{"field":"I"}},"id":"57850","type":"Line"},{"attributes":{"args":{"AirTemperature":{"id":"56351"},"AtmosphericPressure":{"id":"56359"},"NettRadiation":{"id":"56353"},"RelativeHumidity":{"id":"56352"},"RoughnessHeight":{"id":"56357"},"SpecificHeat":{"id":"56358"},"WaterDensity":{"id":"56354"},"WindSpeed":{"id":"56355"},"WindSpeedElevation":{"id":"56356"},"sourceEvaporationParameterTable":{"id":"56361"},"sourcePlotSlider_Rh":{"id":"56422"},"sourcePlotSlider_Rn":{"id":"56369"},"sourcePlotSlider_T":{"id":"56475"},"sourcePlotSlider_u":{"id":"56528"},"sourceProfile_Rh":{"id":"56423"},"sourceProfile_Rn":{"id":"56370"},"sourceProfile_T":{"id":"56476"},"sourceProfile_u":{"id":"56529"}},"code":"\n                                // Slider data ////////////////////////////////\n                                \n                                const Ta = AirTemperature.value;\n                                const Rh = RelativeHumidity.value;\n                                const Rn = NettRadiation.value;\n                                const rhow = 1000 // 8.50950e-09*Ta**5 - 1.53954e-06*Ta**4 + 1.24178e-04*Ta**3 - 9.51691e-03*Ta**2 + 7.15059e-02*Ta + 9.99863e+02;\n                                const u = WindSpeed.value*1000/3600; // converts input km/h to m/s used in calcs\n                                const z = WindSpeedElevation.value;\n                                const z0 = RoughnessHeight.value;\n                                const Cp = SpecificHeat.value;\n                                const Patm = AtmosphericPressure.value;\n                                \n                                \n                                // Constants //////////////////////////////////\n                                \n                                // Declare variables //////////////////////////\n                                \n                                var es, e, lv, Er, rho_vs, u_star, Ea, delta, gamma, ddg, gdg, Ec, rho_v\n                                \n                                // calcs //////////////////////////////////////\n                                \n                                function getEvaporationParameters(Ta,Rh,Rn,rhow,u,z,z0,Cp,Patm) {\n                                    es = 611*Math.exp(17.27*Ta/(237.3+Ta))\n                                    e = Rh/100*es\n                                    lv = 2.501*Math.pow(10,6) - 2370*Ta\n                                    Er = Rn/rhow/lv\n                                    rho_vs = es/461/(273+Ta)\n                                    u_star = u*0.4/Math.log(z/(z0/1000))\n                                    Ea = (1-Rh/100)*(rho_vs/rhow)*Math.pow((u_star/u),2)*u // m/s\n                                    delta = 4098*es/Math.pow((237.3+Ta),2)\n                                    gamma = Cp*Patm/0.622/lv\n                                    ddg = delta/(delta+gamma)\n                                    gdg = gamma/(delta+gamma)\n                                    Ec = ddg*Er + gdg*Ea\n                                    rho_v = e/461/(273+Ta)\n                                    \n                                    return [es,e,lv,Er,rho_vs,u_star,Ea,delta,gamma,ddg,gdg,Ec,rho_v];\n                                    }                                    \n                                    \n                                // update table source data ///////////////////\n                                let EvaporationParameters = getEvaporationParameters(Ta,Rh,Rn,rhow,u,z,z0,Cp,Patm)\n                                \n                                lv = lv/1000 // convert J/kg to kJ/kg\n                                sourceEvaporationParameterTable.data['Value'][0] = lv.toFixed(3);\n                                sourceEvaporationParameterTable.data['Value'][1] = rhow.toFixed(3);\n                                Er = Er*1000*86400 // convert m/s to mm/d\n                                sourceEvaporationParameterTable.data['Value'][2] = Er.toFixed(2);\n                                sourceEvaporationParameterTable.data['Value'][3] = es.toFixed(2);\n                                sourceEvaporationParameterTable.data['Value'][4] = rho_vs.toFixed(4);\n                                sourceEvaporationParameterTable.data['Value'][5] = u_star.toFixed(4);\n                                Ea = Ea*1000*86400 // convert m/s to mm/d\n                                sourceEvaporationParameterTable.data['Value'][6] = Ea.toFixed(2);\n                                sourceEvaporationParameterTable.data['Value'][7] = delta.toFixed(4);\n                                sourceEvaporationParameterTable.data['Value'][8] = gamma.toFixed(4);\n                                sourceEvaporationParameterTable.data['Value'][9] = ddg.toFixed(4);\n                                sourceEvaporationParameterTable.data['Value'][10] = gdg.toFixed(4);\n                                Ec = Ec*1000*86400 // convert m/s to mm/d\n                                sourceEvaporationParameterTable.data['Value'][11] = Ec.toFixed(2);\n                                \n                                sourceEvaporationParameterTable.change.emit();\n\n                                // upodated plot slider points\n                                sourcePlotSlider_T.data['xPoint'][0] = Ta;\n                                sourcePlotSlider_T.data['xPoint'][1] = Ta;\n                                sourcePlotSlider_T.data['xPoint'][2] = Ta;\n                                sourcePlotSlider_T.data['yPoint'][0] = Er;\n                                sourcePlotSlider_T.data['yPoint'][1] = Ea;\n                                sourcePlotSlider_T.data['yPoint'][2] = Ec;\n                                sourcePlotSlider_T.change.emit();\n\n                                sourcePlotSlider_u.data['xPoint'][0] = u*3.6;\n                                sourcePlotSlider_u.data['xPoint'][1] = u*3.6;\n                                sourcePlotSlider_u.data['xPoint'][2] = u*3.6;\n                                sourcePlotSlider_u.data['yPoint'][0] = Er;\n                                sourcePlotSlider_u.data['yPoint'][1] = Ea;\n                                sourcePlotSlider_u.data['yPoint'][2] = Ec;\n                                sourcePlotSlider_u.change.emit();\n                                \n                                sourcePlotSlider_Rh.data['xPoint'][0] = Rh;\n                                sourcePlotSlider_Rh.data['xPoint'][1] = Rh;\n                                sourcePlotSlider_Rh.data['xPoint'][2] = Rh;\n                                sourcePlotSlider_Rh.data['yPoint'][0] = Er;\n                                sourcePlotSlider_Rh.data['yPoint'][1] = Ea;\n                                sourcePlotSlider_Rh.data['yPoint'][2] = Ec;\n                                sourcePlotSlider_Rh.change.emit();\n                                \n                                sourcePlotSlider_Rn.data['xPoint'][0] = Rn;\n                                sourcePlotSlider_Rn.data['xPoint'][1] = Rn;\n                                sourcePlotSlider_Rn.data['xPoint'][2] = Rn;\n                                sourcePlotSlider_Rn.data['yPoint'][0] = Er;\n                                sourcePlotSlider_Rn.data['yPoint'][1] = Ea;\n                                sourcePlotSlider_Rn.data['yPoint'][2] = Ec;\n                                sourcePlotSlider_Rn.change.emit();\n                                \n                                // update profile plots ///////////////////////\n                                // DOESN;T WORK BECAUSE OF VARIABLE POSITIONING of xProfile IN getEvaporationParameters\n                                //function updateProfilePlots(dataProfile) {\n                                //  const xProfile = dataProfile['xProfile'];\n                                //  const Er_Profile = dataProfile['Er'];\n                                //  const Ea_Profile = dataProfile['Ea'];\n                                //  const Ec_Profile = dataProfile['Ec'];\n                                //  for (let ii = 0; ii &lt; xProfile.length; ii++) \n                                //      {\n                                //      let EvaporationParameters = getEvaporationParameters(xProfile[ii],Rh,Rn,rhow,u,z,z0,Cp,Patm)\n                                //      Er_Profile[ii] = EvaporationParameters[3]*1000*86400\n                                //      Ea_Profile[ii] = EvaporationParameters[6]*1000*86400\n                                //      Ec_Profile[ii] = EvaporationParameters[11]*1000*86400\n                                //      }\n                                //  }\n                                    \n                                // temperature profile update /////////////////\n                                const dataProfile_T = sourceProfile_T.data;\n                                const T = dataProfile_T['xProfile'];\n                                const Er_T = dataProfile_T['Er'];\n                                const Ea_T = dataProfile_T['Ea'];\n                                const Ec_T = dataProfile_T['Ec'];\n                                for (let ii = 0; ii &lt; T.length; ii++) {\n                                        let EvaporationParameters = getEvaporationParameters(T[ii],Rh,Rn,rhow,u,z,z0,Cp,Patm)\n                                        Er_T[ii] = EvaporationParameters[3]*1000*86400\n                                        Ea_T[ii] = EvaporationParameters[6]*1000*86400\n                                        Ec_T[ii] = EvaporationParameters[11]*1000*86400\n                                        }\n                                sourceProfile_T.change.emit();\n    \n                                // Rh profile update //////////////////////////\n                                const dataProfile_Rh = sourceProfile_Rh.data;\n                                const RhP = dataProfile_Rh['xProfile'];\n                                const Er_Rh = dataProfile_Rh['Er'];\n                                const Ea_Rh = dataProfile_Rh['Ea'];\n                                const Ec_Rh = dataProfile_Rh['Ec'];\n                                for (let ii = 0; ii &lt; RhP.length; ii++) {\n                                        let EvaporationParameters = getEvaporationParameters(Ta,RhP[ii],Rn,rhow,u,z,z0,Cp,Patm)\n                                        Er_Rh[ii] = EvaporationParameters[3]*1000*86400\n                                        Ea_Rh[ii] = EvaporationParameters[6]*1000*86400\n                                        Ec_Rh[ii] = EvaporationParameters[11]*1000*86400\n                                        }\n                                sourceProfile_Rh.change.emit();\n\n                                // Rn profile update //////////////////////////\n                                const dataProfile_Rn = sourceProfile_Rn.data;\n                                const RnP = dataProfile_Rn['xProfile'];\n                                const Er_Rn = dataProfile_Rn['Er'];\n                                const Ea_Rn = dataProfile_Rn['Ea'];\n                                const Ec_Rn = dataProfile_Rn['Ec'];\n                                for (let ii = 0; ii &lt; RnP.length; ii++) {\n                                        let EvaporationParameters = getEvaporationParameters(Ta,Rh,RnP[ii],rhow,u,z,z0,Cp,Patm)\n                                        Er_Rn[ii] = EvaporationParameters[3]*1000*86400\n                                        Ea_Rn[ii] = EvaporationParameters[6]*1000*86400\n                                        Ec_Rn[ii] = EvaporationParameters[11]*1000*86400\n                                        }\n                                sourceProfile_Rn.change.emit();\n\n                                // u profile update ///////////////////////////\n                                const dataProfile_u = sourceProfile_u.data;\n                                const uP = dataProfile_u['xProfile'];\n                                const Er_u = dataProfile_u['Er'];\n                                const Ea_u = dataProfile_u['Ea'];\n                                const Ec_u = dataProfile_u['Ec'];\n                                for (let ii = 0; ii &lt; uP.length; ii++) {\n                                        var u_ms = uP[ii]/3.6                                        \n                                        let EvaporationParameters = getEvaporationParameters(Ta,Rh,Rn,rhow,u_ms,z,z0,Cp,Patm)\n                                        Er_u[ii] = EvaporationParameters[3]*1000*86400\n                                        Ea_u[ii] = EvaporationParameters[6]*1000*86400\n                                        Ec_u[ii] = EvaporationParameters[11]*1000*86400\n                                        }\n                                sourceProfile_u.change.emit();\n                                \n\n                                "},"id":"56581","type":"CustomJS"},{"attributes":{},"id":"58561","type":"DataRange1d"},{"attributes":{"format":"00[.]00","text_align":"center"},"id":"57807","type":"NumberFormatter"},{"attributes":{"text":"&lt;h1&gt;Flood Frequency Analysis&lt;/h1&gt;\n                   &lt;p&gt;This applet applies the method of moments to estimate return level peak flow estimates based on the Extreme Value Distribution (EVD) and the Log Pearson Type III (LP3) distributions. \n                   The effect of record length and historical period on flood frequency analysis can be examined by adjusting the year range slider.&lt;br&gt;\n                   &lt;i&gt;Further details and the equations can be found in the &lt;b&gt;&lt;a href=\"#Background\"&gt;Background&lt;/a&gt;&lt;/b&gt; section below.&lt;/i&gt;\n\n                   &lt;/p&gt;\n                   \n                   &lt;p&gt;The data used here are Annual Flood Series data derived from the &lt;a href=\"https://www.google.com/maps/place/28%C2%B003'15.1%22S+153%C2%B002'40.5%22E/@-28.0520185,153.0323593,6506m/data=!3m1!1e3!4m5!3m4!1s0x0:0x71dbb468cb20540d!8m2!3d-28.0541944!4d153.0445833\" target=\"_blank\"&gt;Lumeah flow gauge on the Albert River, Qld, Australia for the period 1955 to 2019.&lt;/a&gt;. \n                   The data was sourced from the Queensland Government's &lt;a href=\"https://water-monitoring.information.qld.gov.au/\" target=\"_blank\"&gt;Water Monitoring Information Portal&lt;/a&gt;.\n                   &lt;/p&gt;\n                   \n                   \n                   "},"id":"58628","type":"Div"},{"attributes":{"line_alpha":0.2,"line_color":"green","line_dash":[6],"line_width":2,"x":{"field":"AEP_pc"},"y":{"field":"E ue","x":{"field":"xProfile"},"y":{"field":"Er"}},"id":"56451","type":"Line"},{"attributes":{"line_alpha":0.1,"line_color":"green","line_width":2,"x":{"field":"AEP_pc"},"y":{"field":"EVD_QT"}},"id":"58531","type":"Line"},{"attributes":{"button_type":"success","icon":null,"js_event_callbacks":{"button_click":[{"id":"58626"}]},"label":"Click to Restore Defaults","width":100},"id":"58625","type":"Button"},{"attributes":{"coordinates":null,"data_source":{"id":"58378"},"glyph":{"id":"58536"},"group":null,"hover_glyph":null,"muted_glyph":{"id":"58538"},"nonselection_glyph":{"id":"58537"},"view":{"id":"58540"}},"id":"58539","type":"GlyphRenderer"},{"attributes":{},"id":"58179","type":"StringEditor"},{"attributes":{"coordinates":null,"data_source":{"id":"58377"},"glyph":{"id":"58600"},"group":null,"hover_glyph":null,"muted_glyph":{"id":"58602"},"nonselection_glyph":{"id":"58601"},"view":{"id":"58604"}},"id":"58603","type":"GlyphRenderer"},{"attributes":{"line_alpha":0.2,"line_color":"green","line_width":2,"x":{"field":"AEP_pc"},"y":{"field":"EVD_QT"}},"id":"58532","type":"Line"},{"attributes":{"coordinates":null,"data_source":{"id":"58377"},"glyph":{"id":"58542"},"group":null,"hover_glyph":null,"muted_glyph":{"id":"58544"},"nonselection_glyph":{"id":"58543"},"view":{"id":"58546"}},"id":"58545","type":"GlyphRenderer"},{"attributes":{"source":{"id":"58377"}},"id":"58604","type":"CDSView"},{"attributes":{"callback":null,"names":["profile"],"tooltips":[["Rn (W/m^2)","@xProfile"],["Er (mm/d)","@Er{0.2f}"],["Ea (mm/d)","@Ea{0.2f}"],["Ec (mm/d)","@Ec{0.2f}"]]},"id":"56418","type":"HoverTool"},{"attributes":{},"id":"58727","type":"Selection"},{"attributes":{"fill_color":{"value":"green"},"line_color":{"value":"green"},"size":{"value":8},"x":{"field":"Qp"},"y":{"field":"EVD_QT"}},"id":"58606","type":"Scatter"},{"attributes":{"line_alpha":0.1,"line_color":"red","line_width":2,"x":{"field":"AEP_pc"},"y":{"field":"LP3_QT"}},"id":"58537","type":"Line"},{"attributes":{},"id":"58180","type":"StringEditor"},{"attributes":{"fill_alpha":{"value":0.1},"fill_color":{"value":"green"},"hatch_alpha":{"value":0.1},"line_alpha":{"value":0.1},"line_color":{"value":"green"},"size":{"value":8},"x":{"field":"Qp"},"y":{"field":"EVD_QT"}},"id":"58607","type":"Scatter"},{"attributes":{"line_color":"red","line_width":2,"x":{"field":"AEP_pc"},"y":{"field":"LP3_QT"}},"id":"58536","type":"Line"},{"attributes":{},"id":"58728","type":"StringEditor"},{"attributes":{"fill_alpha":{"value":0.2},"fill_color":{"value":"red"},"hatch_alpha":{"value":0.2},"line_alpha":{"value":0.2},"line_color":{"value":"red"},"size":{"value":8},"x":{"field":"Qp"},"y":{"field":"LP3_QT"}},"id":"58602","type":"Scatter"},{"attributes":{"autosize_mode":"none","columns":[{"id":"56362"},{"id":"56364"}],"index_position":null,"reorderable":false,"sortable":false,"source":{"id":"56361"},"view":{"id":"56368"}},"id":"56366","type":"DataTable"},{"attributes":{"axis_label":"$$R_n \\quad (W/m^2)$$","axis_label_standoff":10,"axis_label_text_color":"#5B5B5B","axis_label_text_font":"Calibri Light","axis_label_text_font_size":"1.15em","axis_label_text_font_style":"bold","axis_line_alpha":1,"axis_line_color":"#5B5B5B","coordinates":null,"formatter":{"id":"58902"},"group":null,"major_label_policy":{"id":"58903"},"major_label_text_color":"#5B5B5B","major_label_text_font":"Calibri Light","major_label_text_font_size":"0.95em","major_label_text_font_style":"bold","major_tick_in":0,"major_tick_line_alpha":0.25,"major_tick_line_color":"#5B5B5B","major_tick_out":3,"minor_tick_line_alpha":0.25,"minor_tick_line_color":"#5B5B5B","ticker":{"id":"56381"}},"id":"56380","type":"LinearAxis"},{"attributes":{"args":{"legendItemsAEP":[{"id":"58554"},{"id":"58555"},{"id":"58556"},{"id":"58557"},{"id":"58558"},{"id":"58559"}],"legendItemsSkill":[{"id":"58618"},{"id":"58619"},{"id":"58620"},{"id":"58621"},{"id":"58622"}],"slider_YearRange":{"id":"58623"},"source_AnnualFloodSeries":{"id":"58367"},"source_AnnualFloodSeries_Filtered":{"id":"58379"},"source_AnnualFloodSeries_Sorted_Filtered":{"id":"58378"},"source_Filtered_Shading":{"id":"58380"},"source_GoodnessOfFit":{"id":"58382"},"source_ReturnLevels":{"id":"58395"},"source_TableStats":{"id":"58368"}},"code":"\n\n                        // get slider values //////////////////////////////////\n                        const yearStart = slider_YearRange.value[0];\n                        const yearEnd = slider_YearRange.value[1];\n                        \n                        // Creating the Data Sources //////////////////////////\n                        const data_All = source_AnnualFloodSeries.data;\n                        \n                        // filter data ////////////////////////////////////////\n                        var year_filtered = []\n                        var Qp_filtered = []\n                        var X_filtered = []\n                        var index_filtered = []\n                        var jj = 0\n                        for (var ii=0; ii&lt;data_All['Year'].length; ii++){\n                            if (data_All['Year'][ii]&gt;=yearStart &amp;&amp; data_All['Year'][ii]&lt;=yearEnd){\n                                    year_filtered[jj] = data_All['Year'][ii];\n                                    Qp_filtered[jj] = data_All['Qp'][ii];\n                                    X_filtered[jj] = Math.log10(Qp_filtered[jj])\n                                    index_filtered[jj] = jj;\n                                    jj = jj + 1;\n                                    }    \n                                }\n\n                        source_AnnualFloodSeries_Filtered.data['Year'] = year_filtered;\n                        source_AnnualFloodSeries_Filtered.data['Qp'] = Qp_filtered;\n                        source_AnnualFloodSeries_Filtered.data['index'] = index_filtered;\n                        source_AnnualFloodSeries_Filtered.change.emit();\n\n                        source_Filtered_Shading.data['x'][0] = year_filtered[0]-0.5\n                        source_Filtered_Shading.data['x'][1] = year_filtered[jj-1]+0.5\n                        source_Filtered_Shading.data['x'][2] = year_filtered[jj-1]+0.5\n                        source_Filtered_Shading.data['x'][3] = year_filtered[0]-0.5\n                        source_Filtered_Shading.data['y'][2] = 1.1*Math.max.apply(null, data_All['Qp'])\n                        source_Filtered_Shading.data['y'][3] = 1.1*Math.max.apply(null, data_All['Qp'])\n                        source_Filtered_Shading.change.emit();\n                        \n                        // stats on filtered data /////////////////////////////\n                        function skewness( arr ) {\n                        \tif ( !Array.isArray( arr ) ) {\n                        \t\tthrow new TypeError( 'skewness()::invalid input argument. Must provide an array.' );\n                        \t}\n                        \tvar len = arr.length,\n                        \t\tdelta = 0,\n                        \t\tdelta_n = 0,\n                        \t\tterm1 = 0,\n                        \t\tN = 0,\n                        \t\tmean = 0,\n                        \t\tM2 = 0,\n                        \t\tM3 = 0,\n                        \t\tg;\n                        \n                        \tfor ( var i = 0; i &lt; len; i++ ) {\n                        \t\tN += 1;\n                        \t\tdelta = arr[ i ] - mean;\n                        \t\tdelta_n = delta / N;\n                        \t\tterm1 = delta * delta_n * (N-1);\n                        \t\tM3 += term1*delta_n*(N-2) - 3*delta_n*M2;\n                        \t\tM2 += term1;\n                        \t\tmean += delta_n;\n                        \t}\n                        \t// Calculate the population skewness:\n                        \tg = Math.sqrt( N )*M3 / Math.pow( M2, 3/2 );\n                        \n                        \t// Return the corrected sample skewness:\n                        \treturn Math.sqrt( N*(N-1))*g / (N-2);\n                        }\n\n                        function getStats(array){\n                            const n = array.length\n                            const sum = array.reduce((a, b) =&gt; a + b, 0);\n                            const mean = (sum / array.length) || 0;\n                            const stddev = Math.sqrt(array.map(x =&gt; Math.pow(x - mean, 2)).reduce((a, b) =&gt; a + b) / (n-1));\n                            const skew = skewness(array)\n                            const CV = stddev/mean\n                            return [mean, stddev, skew, CV]\n                            }\n                        \n                        let statsQ = getStats(Qp_filtered)\n                        source_TableStats.data['Stats_Filtered'][0] = jj\n                        source_TableStats.data['Stats_Filtered'][1] = statsQ[0].toFixed(2)\n                        source_TableStats.data['Stats_Filtered'][2] = statsQ[1].toFixed(2)\n                        source_TableStats.data['Stats_Filtered'][3] = statsQ[2].toFixed(3)\n                        source_TableStats.data['Stats_Filtered'][4] = statsQ[3].toFixed(4)\n\n                        let statsX = getStats(X_filtered)\n                        source_TableStats.data['Stats_Filtered'][5] = statsX[0].toFixed(4)\n                        source_TableStats.data['Stats_Filtered'][6] = statsX[1].toFixed(4)\n                        source_TableStats.data['Stats_Filtered'][7] = statsX[2].toFixed(4)\n                        source_TableStats.change.emit();\n\n                        // LP3 function \n                        var w,z,k,g,Kt,XT,QT\n                        function LP3(AEP, g){\n                                if (AEP &lt;= 0.5){\n                                    w = Math.sqrt(Math.log(1/AEP**2))\n                                    z = w - (2.515517 + 0.802853*w + 0.010328*w**2)/(1 + 1.432788*w + 0.189269*w**2 + 0.001308*w**3)\n                                    }\n                                else {\n                                    w = Math.sqrt(Math.log(1/(1-AEP)**2))\n                                    z = w - (2.515517 + 0.802853*w + 0.010328*w**2)/(1 + 1.432788*w + 0.189269*w**2 + 0.001308*w**3)\n                                    z = -z\n                                    }\n                                k = g/6\n                                Kt = z + (z**2-1)*k + 1/3*(z**3-6*z)*k**2 - (z**2-1)*k**3 + z*k**4 + 1/3*k**5           \n                                XT = statsX[0] + statsX[1]*Kt\n                                QT = 10**XT        \n                                return [Kt, XT, QT]\n                            }\n                            \n                        // Return levels //////////////////////////////////////\n                        const T = source_ReturnLevels.data['T'];\n                        var QT_EVD = []\n                        var QT_LP3 = []\n                        for (ii=0; ii&lt;T.length; ii++){\n                                QT_EVD[ii] = statsQ[0] + statsQ[1]*-Math.sqrt(6)/Math.PI*(0.5772157 + Math.log(Math.log(T[ii]/(T[ii]-1))))\n                                let LP3T = LP3(1/T[ii],statsX[2])\n                                QT_LP3[ii] = LP3T[2]\n                                }\n                        source_ReturnLevels.data['EVD Filt'] = QT_EVD.map(function(each_element){return Number(each_element.toFixed(2));});\n                        source_ReturnLevels.data['LP3 Filt'] = QT_LP3.map(function(each_element){return Number(each_element.toFixed(2));});\n                        source_ReturnLevels.change.emit();\n                        \n                        // method of moments //////////////////////////////////\n                        var Qp_sorted = Qp_filtered.sort(function(a, b) {return b - a; });;\n                        var rank = []\n                        var aep = []\n                        var aep_pc = []\n                        var rp = []\n                        var Qp_EVD = []\n                        var Qp_LP3 = []\n                        for (ii=0; ii&lt;Qp_sorted.length; ii++){\n                                rank[ii] = ii+1\n                                aep[ii] = rank[ii]/(Qp_sorted.length + 1)\n                                aep_pc[ii] = 100*aep[ii]\n                                rp[ii] = 1/aep[ii]\n                                Qp_EVD[ii] = statsQ[0] + statsQ[1]*-Math.sqrt(6)/Math.PI*(0.5772157 + Math.log(Math.log(rp[ii]/(rp[ii]-1))))\n                                let LP3T = LP3(1/rp[ii], statsX[2])\n                                Qp_LP3[ii] = LP3T[2]\n                                }\n                        source_AnnualFloodSeries_Sorted_Filtered.data['Qp'] = Qp_sorted\n                        source_AnnualFloodSeries_Sorted_Filtered.data['Rank'] = rank\n                        source_AnnualFloodSeries_Sorted_Filtered.data['AEP'] = aep\n                        source_AnnualFloodSeries_Sorted_Filtered.data['AEP_pc'] = aep_pc\n                        source_AnnualFloodSeries_Sorted_Filtered.data['ARI'] = rp\n                        source_AnnualFloodSeries_Sorted_Filtered.data['EVD_QT'] = Qp_EVD\n                        source_AnnualFloodSeries_Sorted_Filtered.data['LP3_QT'] = Qp_LP3\n                        source_AnnualFloodSeries_Sorted_Filtered.data['index'] = index_filtered\n                        source_AnnualFloodSeries_Sorted_Filtered.change.emit();\n                        \n                        // goodness of fit ////////////////////////////////////\n                        \n                        function lin_corr(x,y){\n                            \n                            // translated from Bofu's python code\n\n                            // to return the linear correlation coefficient between x and y\n                            // x and y are assumed to be np arrays of the same length\n                                \n                            var n = x.length\n                        \n                            //     mx --  mean of x\n                            //     my --  mean of y\n                            //     vx --  variance of x\n                            //     vy --  variance of y\n                            //     vxy -- cvariance of x and y\n\n                            // sum = [1, 2, 3].reduce((partialSum, a) =&gt; partialSum + a, 0);\n\n                            var mx = x.reduce((partialSum, a) =&gt; partialSum + a, 0)/n\n                            var my = y.reduce((partialSum, a) =&gt; partialSum + a, 0)/n\n                            \n                            var vx = 0\n                            var vy = 0\n                            var vxy = 0\n                            var tx, ty\n                            for ( var i = 0; i &lt; x.length; i++ ) {\n                                tx = x[i] - mx\n                                ty = y[i] - my\n                                vx = vx + tx*tx\n                                vy = vy + ty*ty\n                                vxy = vxy + tx*ty\n                                }\n                            vx = vx/n\n                            vy = vy/n\n                            vxy = vxy/n\n                            \n                            var r = vxy/Math.sqrt(vx*vy)\n                            var r2 = r*r\n                            return r2\n                            }\n                        \n                        // do the updating\n                        let r2_EVD_Filtered = lin_corr(Qp_sorted, Qp_EVD)\n                        source_GoodnessOfFit.data['R^2'][1] = r2_EVD_Filtered.toFixed(3);\n\n                        let r2_LP3_Filtered = lin_corr(Qp_sorted, Qp_LP3)\n                        source_GoodnessOfFit.data['R^2'][3] = r2_LP3_Filtered.toFixed(3);\n                        source_GoodnessOfFit.change.emit();\n                        \n                        // update legends /////////////////////////////////////\n                        legendItemsSkill[3].label.value = 'EVD - Filtered (R^2=' + (r2_EVD_Filtered.toFixed(3)).toString() + ')';\n                        legendItemsSkill[4].label.value = 'LP3 - Filtered (R^2=' + (r2_LP3_Filtered.toFixed(3)).toString() + ')';\n                        legendItemsAEP[4].label.value = 'EVD - Filtered (R^2=' + (r2_EVD_Filtered.toFixed(3)).toString() + ')';\n                        legendItemsAEP[5].label.value = 'LP3 - Filtered (R^2=' + (r2_LP3_Filtered.toFixed(3)).toString() + ')';\n                        \n                        "},"id":"58624","type":"CustomJS"},{"attributes":{"source":{"id":"58378"}},"id":"58552","type":"CDSView"},{"attributes":{},"id":"56378","type":"LinearScale"},{"attributes":{"coordinates":null,"data_source":{"id":"58378"},"glyph":{"id":"58606"},"group":null,"hover_glyph":null,"muted_glyph":{"id":"58608"},"nonselection_glyph":{"id":"58607"},"view":{"id":"58610"}},"id":"58609","type":"GlyphRenderer"},{"attributes":{},"id":"58928","type":"Selection"},{"attributes":{"fill_alpha":{"value":0.5},"fill_color":{"field":"color"},"hatch_alpha":{"value":0.5},"line_alpha":{"value":0.5},"marker":{"value":"circle_dot"},"size":{"value":10},"x":{"field":"xPoint"},"y":{"field":"yPoint"}},"id":"56408","type":"Scatter"},{"attributes":{"axis":{"id":"56433"},"coordinates":null,"group":null,"ticker":null},"id":"56436","type":"Grid"},{"attributes":{"fill_alpha":{"value":0.2},"fill_color":{"value":"#1f77b4"},"hatch_alpha":{"value":0.2},"line_alpha":{"value":0.2},"line_color":{"value":"#1f77b4"},"size":{"value":6},"x":{"field":"AEP_pc"},"y":{"field":"Qp"}},"id":"58550","type":"Scatter"},{"attributes":{"template":"                \n                &lt;p style=\"line-height: 0.3; \n                    color:&lt;%= \n                    (function rowcolor(){\n                        if (Parameter == 'Energy Balance Method, Er (mm/d)')\n                            {return('blue')}\n "},"hatch_alpha":{"value":0.2},"line_alpha":{"value":0.2},"line_color":{"value":"green"},"size":{"value":8},"x":{"field":"Qp"},"y":{"field":"EVD_QT"}},"id":"58608","type":"Scatter"},{"attributes":{"text":"\n        &lt;a id=\"Background\"&gt;&lt;h2&gt;Background&lt;/h2&gt;&lt;/a&gt;\n       \n        &lt;p&gt;The main factors limiting evaporation are:&lt;/p&gt;\n            &lt;ol&gt;\n                &lt;li&gt;&lt;b&gt;Solar radiation:&lt;/b&gt; the supply of heat energy required to satisfy the latent heat of vapourisation&lt;/li&gt;\n                &lt;li&gt;&lt;b&gt;Vapour transport:&lt;/b&gt; the ability to transport water vapour away from the evaporative surface which depends on:\n                    &lt;ol type=\"a\"&gt;\n                        &lt;li&gt;the temperature/degree of saturation of the air mass (which defines the capacity of the air mass to take on more vapour)&lt;/li&gt;\n                        &lt;li&gt;advection of vapour away from the evaporating surface by wind which maintains a saturation deficit in the overlying air&lt;/li&gt;\n                    &lt;/ol&gt;\n                &lt;/li&gt;\n                &lt;li&gt;&lt;b&gt;Water supply:&lt;/b&gt; the availability of water at the evaporative surface (e.g. oceans versus dry desert).&lt;/li&gt;\n            &lt;/ol&gt;\n        &lt;p&gt;The &lt;u&gt;&lt;b&gt;POTENTIAL&lt;/b&gt;&lt;/u&gt; evaporation rate is the maximum possible rate for a given set of atmospheric condditions &lt;i&gt;&lt;b&gt;assuming that the supply of water is not a limiting factor&lt;/b&gt;&lt;/i&gt; (e.g. that which is observed over an ocean or lake). \n        &lt;/p&gt;\n\n        &lt;h3&gt;Energy balance method&lt;/h3&gt;\n\n        &lt;p&gt;The Energy Balance method assumes that vapour transport doesn't limit evaporation and quantifies energy supply as the limiting factor, &lt;br&gt;\n            $$\\quad E_r = \\frac{R_n}{\\rho_w l_v} \\quad \\left(m/s\\right)$$ &lt;br&gt;\n            where $$R_n$$ is the net colar radiation $$\\left(W/m^2\\right)$$, $$\\rho_w$$ is the density of water $$\\left(kg/m^3\\right)$$ and $$l_v$$ is the latent heat of vapourisation (J/kg) given by, &lt;br&gt;\n            $$\\quad l_v = 2.501 \\times 10^{-6} -2370T$$ where $$T$$ is the temperature $$\\left(^\\circ C\\right)$$.&lt;br&gt;\n            In this application, the water density is assumed to be constant at $$\\rho_w = 1000 kg/m^3$$.\n        &lt;/p&gt;\n\n        &lt;h3&gt;Aerodynamic (vapour transport) method&lt;/h3&gt;\n\n        &lt;p&gt;The Aerodynamic method assumes that enery supply does not limit evaporation and quantifies vapour transport as the limiting factor, &lt;br&gt;\n            $$\\quad E_a = \\left(\\frac{\\rho_{vs}}{\\rho_w}\\right)\\left(\\frac{u_*}{u}\\right)^2\\left(1-R_h\\right) \\quad \\left(m/s\\right)$$ &lt;br&gt;\n             where $$\\rho_{vs}$$ is the saturation vapour density $$\\left(kg/m^3\\right)$$, $$R_h$$ is the relative humidity, $$u$$ is the wind speed $$\\left(m/s\\right)$$ and $$u^*$$ is the friction velocity $$\\left(m/s\\right)$$ which is found from the log-law, &lt;br&gt;\n             $$\\quad \\frac{u^*}{u}=\\frac{\\kappa}{ln\\left(\\frac{z}{z_0}\\right)} $$ &lt;br&gt;\n             where $$\\kappa = 0.4$$ is von Karmen's constant, $$z$$ is the height above the evaporating surface where the wind speed $$u$$ is measured and $$z_0$$ is the surface roughness height.\n        &lt;/p&gt;\n        \n        &lt;p&gt;The saturated vapour density $$\\rho_{vs}$$ is found using the ideal gas law, &lt;br&gt;\n            $$\\quad e_s = \\rho_{vs}R_vT \\quad \\left(Pa\\right)$$ &lt;br&gt;\n            where $$R_v = 461 J/kg/^\\circ K$$  is the universal gas constant and $$T$$ is the air temperature in $$^\\circ K$$ $$\\left(=^\\circ C + 273\\right)$$.&lt;br&gt;\n            The saturated vapour pressure $$e_s$$ is given by, &lt;br&gt;\n            $$\\quad e_s\\left(T\\right) = 611\\exp\\left({\\frac{17.27T}{237.3 + T}}\\right) \\quad (Pa) $$ &lt;br&gt;\n            where $$T$$ is air temperature in $$^\\circ C$$.\n        &lt;/p&gt;\n\n        &lt;h3&gt;Combined method&lt;/h3&gt;\n\n        &lt;p&gt;The Combined method is a weighted average of the Energy Balanace and Aerodynamic methods taking into account the two limiting factors energy supply and vapour transport and is given by, &lt;br&gt;\n            $$\\quad E_c = \\left(\\frac{\\Delta}{\\Delta+\\gamma}\\right)E_r + \\left(\\frac{\\gamma}{\\Delta+\\gamma}\\right)E_a \\quad \\left(m/s\\right) $$ &lt;br&gt;\n                where $$\\Delta$$ is the slope of the saturation vapour pressure curve $$\\left(Pa/^\\circ C\\right)$$ given by,&lt;br&gt;\n                $$\\quad \\Delta=\\frac{de_s}{dT}=\\frac{4098e_s}{\\left(237.3+T\\right)^2} \\quad \\left(Pa/^\\circ C\\right)$$ &lt;br&gt;\n                $$T$$ is the air temperature $$\\left(^\\circ C\\right)$$ and $$e_s$$ is the saturation vapour pressure $$\\left(Pa\\right)$$. $$\\gamma$$ is is the psychrometric constant given by,&lt;br&gt;\n                $$\\quad \\gamma = \\frac{C_pp}{0.622l_v} \\approx 67 \\textrm{Pa/}^\\circ\\textrm{C} $$ &lt;br&gt;\n                where $$p$$ is the atmospheric pressure taken to be fixed at $$101,590 \\left(Pa\\right)$$, $$C_p$$ is the  specific heat of air taken to be $$1005 \\left(J/kg/^\\circ K\\right)$$.&lt;br&gt;\n                Note that, &lt;br&gt;\n                $$\\quad \\left(\\frac{\\Delta}{\\Delta+\\gamma}\\right) + \\left(\\frac{\\gamma}{\\Delta+\\gamma}\\right)  = 1 $$\n\n        &lt;/p&gt;\n                         "},"id":"56586","type":"Div"},{"attributes":{"label":{"value":"Data - Filtered"},"renderers":[{"id":"58551"}]},"id":"58557","type":"LegendItem"},{"attributes":{"children":[{"id":"58635"},{"id":"58636"}]},"id":"58637","type":"Row"},{"attributes":{"data":{"Ea":{"__ndarray__":"5ekPMspx6z/I0q4rNKzrP+RFvywM5+s/++DI51Ii7D+T/kEQCV7sPzankFovmuw/WYMLfMbW7D+/zfoqzxPtP3RGmR5KUe0/WyYVDziP7T9FE5G1mc3tP5cUJcxvDO4/j4jfDbtL7j/8GcY2fIvuP5y21gO0y+4/DoYIM2MM7z814UyD "58619","type":"LegendItem"},{"attributes":{"fill_alpha":{"value":0.2},"fill_color":{"field":"color"},"hatch_alpha":{"value":0.2},"line_alpha":{"value":0.2},"marker":{"value":"circle_dot"},"size":{"value":10},"x":{"field":"xPoint"},"y":{"field":"yPoint"}},"id":"56463","type":"Scatter"},{"attributes":{"children":[{"id":"58629"},{"id":"58374"},{"id":"58630"},{"id":"58408"}],"width":400},"id":"58636","type":"Column"},{"attributes":{"editor":{"id":"58895"},"field":"Value","formatter":{"id":"56360"},"title":"Value","width":70},"id":"56364","type":"TableColumn"},{"attributes":{"source":{"id":"56370"}},"id":"56406","type":"CDSView"},{"attributes":{"axis":{"id":"56384"},"coordinates":null,"dimension":1,"group":null,"ticker":null},"id":"56387","type":"Grid"},{"attributes":{},"id":"57857","type":"AllLabels"},{"attributes":{"fill_alpha":{"value":0.1},"fill_color":{"field":"color"},"hatch_alpha":{"value":0.1},"line_alpha":{"value":0.1},"marker":{"value":"circle_dot"},"size":{"value":10},"x":{"field":"xPoint"},"y":{"field":"yPoint"}},"id":"56409","type":"Scatter"},{"attributes":{"flipped":true},"id":"57139","type":"DataRange1d"},{"attributes":{"text":"\n                        \n                        &lt;a name=\"Background\"&gt;&lt;h2&gt;Background&lt;/h2&gt;&lt;/a&gt;\n                        \n                        &lt;h3&gt;Definitions&lt;/h3&gt;\n                        &lt;p&gt;The Annual Exceedance Probability (AEP) is the probability that a flood of a given magnitude ($$Q_o$$) will be exceeded in any given year.&lt;/p&gt;\n                        &lt;p&gt;The average recurrence interval (ARI), or return period (T), for a given flood magnitude $$Q_o$$, is inversely related to the annual exceedance probability (AEP) as follows, &lt;br&gt;\n                            $$\\quad ARI = T = \\frac{1}{AEP} $$ &lt;br&gt;\n                        &lt;/p&gt;\n                        &lt;p&gt;For example a so-called \u201c1 in 100 year\u201d flood has a return period of T=100 years and therefore an AEP = 1/100 = 1%. Note: Engineers Australia are moving away from the use of \u201c100 year flood\u201d and now advise the use of \u201c1% flood\u201d &lt;/p&gt;                       \n\n                        &lt;h3&gt;Empirical frequency analysis&lt;/h3&gt;\n                        &lt;p&gt;The sampling of extreme events falls into two methods: (1) block maxima - the largest peak flow in a specified period of time (e.g. a year) and (2) peak over threshold - all peak flows greater than a specified threshold are sampled.\n                        In the applet, the data used is an Annual Flood Series (largest flow in a water year) and consequently the annual exceedance probability is estimated using, &lt;br&gt;\n                        $$\\quad AEP = \\frac{m}{N+1}$$ &lt;br&gt;\n                        where $$N$$ is the number of years (annual events) and $$m$$ is the rank ($$m=1$$ is the largest, $$m=N$$ is the smallest)\n                        &lt;/p&gt;\n                        &lt;p&gt;Therefore, the ARI is, &lt;br&gt;\n                            $$\\quad ARI = \\frac{1}{AEP} = \\frac{N+1}{m} $$ &lt;br&gt;\n                            and hence the maximum ARI (ie when $$m=1$$) is, &lt;br&gt;\n                            $$\\quad T_{max} = N + 1$$.\n                        &lt;/p&gt;\n                        &lt;p&gt;So to estimate return level flows with an $$ARI &gt; N +1$$ (or an $$AEP \\leq 1/(N+1)$$) requires extrapolation which is achieved using fitted probability distributions. \n                        The two considered here are the Extreme Value Distribution and the log Pearson Type III distribution.\n                        &lt;/p&gt;\n                        \n                        &lt;h3&gt;Extreme Value Distribution (EVD)&lt;/h3&gt;\n                        &lt;p&gt;Return level estimates of the peak flow are estimated from the extreme value distribution using, &lt;br&gt;\n                            $$\\quad Q_T = \\overline{Q} + sK_T $$&lt;br&gt;\n                            where $$\\overline{Q}$$ is the mean and $$s$$ the standard deviation of the sampled flows and $$K_T$$ is the frequency factor given by, &lt;br&gt;\n                            $$\\quad K_t = - \\frac{\\sqrt{6}}{\\pi} \\left\\{\\gamma + \\ln \\left[\\ln \\left(\\frac{T}{T-1}  \\right)  \\right]  \\right\\} $$ &lt;br&gt;\n                            with $$\\gamma = 0.5772157$$ being Euler's constant.\n                        &lt;/p&gt;\n                        \n                        &lt;h3&gt;Log Pearson Type III distribution (LP3)&lt;/h3&gt;\n                        &lt;p&gt;Return level estimates of the peak flow are estimated from the log Pearson type III distribution using, &lt;br&gt;\n                            $$\\quad Q_T = 10^{X_T} $$&lt;br&gt;\n                            where, &lt;br&gt;\n                            $$\\quad X_T = \\overline{X} + sK(T,g) $$&lt;br&gt;\n                            with $$X = \\log_{10}{Q}$$. &lt;br&gt;\n                            Note that $$g$$ is the skewness of the log-transformed flows with the frequency factor $$K(T,g)$$ estimated using, &lt;br&gt;\n                            $$\\quad K(T,g) = z + (z^2-1)k + \\frac{1}{3}(z^3-6z)k^2 - (z^2-1)k^3 + zk^4 + \\frac{1}{3}k^5$$ &lt;br&gt;\n                            where &lt;br&gt;\n                            $$\\quad z = w - \\frac{2.515517 + 0.802853w + 0.010328w^2}{1 + 1.432788w + 0.189269w^2 + 0.001308w^3}$$&lt;br&gt;\n                            and &lt;br&gt;\n                            $$\\quad k = g/6$$&lt;br&gt;\n                            If $$AEP \\leq 0.5$$ then &lt;br&gt;\n                                $$\\quad w = \\sqrt{\\ln \\left( \\frac{1}{AEP^2} \\right) }$$&lt;br&gt;\n                            If $$AEP &gt; 0.5$$ then &lt;br&gt;\n                                $$\\quad w = \\sqrt{\\ln \\left( \\frac{1}{(1-AEP)^2} \\right) }$$ and $$z$$ is given a negative sign&lt;br&gt;\n                        &lt;/p&gt;\n\n                        "},"id":"58627","type":"Div"},{"attributes":{"coordinates":null,"data_source":{"id":"56369"},"glyph":{"id":"56408"},"group":null,"hover_glyph":null,"muted_glyph":{"id":"56410"},"nonselection_glyph":{"id":"56409"},"view":{"id":"56412"}},"id":"56411","type":"GlyphRenderer"},{"attributes":{"line_color":"red","x":{"field":"xProfile"},"y":{"field":"Ec"}},"id":"56404","type":"Line"},{"attributes":{"label":{"value":"LPII - All (R^2=0.968)"},"renderers":[{"id":"58527"}]},"id":"58556","type":"LegendItem"},{"attributes":{"children":[{"id":"58628"},{"id":"58637"},{"id":"58627"},{"id":"58633"}]},"id":"58638","type":"Column"},{"attributes":{"fill_alpha":{"value":0.1},"fill_color":{"field":"color"},"hatch_alpha":{"value":0.1},"line_alpha":{"value":0.1},"marker":{"value":"circle_dot"},"size":{"value":10},"x":{"field":"xPoint"},"y":{"field":"yPoint"}},"id":"56462","type":"Scatter"},{"attributes":{"children":[{"id":"58185"},{"id":"58183"}]},"id":"58186","type":"Column"},{"attributes":{"coordinates":null,"data_source":{"id":"56370"},"glyph":{"id":"56401"},"group":null,"hover_glyph":null,"name":"profile","view":{"id":"56403"}},"id":"56402","type":"GlyphRenderer"},{"attributes":{"editor":{"id":"58725"},"field":"Value","formatter":{"id":"58724"},"title":"Value"},"id":"57300","type":"TableColumn"},{"attributes":{},"id":"58925","type":"UnionRenderers"},{"attributes":{},"id":"58724","type":"StringFormatter"},{"attributes":{"data":{"L":{"__ndarray__":"TwzxoBzjOkBPDPGgHONKQA==","dtype":"float64","order":"little","shape":[2]},"color":["green","red"],"index":[0,1],"legend_label":["Re = 2000","Re = 4000"],"x":{"__ndarray__":"MZEeqJzdOkAxkR6onN1KQA==","dtype":"float64","order":"little","shape":[2]},"zD":{"__ndarray__":"hHc5RieiDUBIsoUal6kGQA==","dtype":"float64","order":"little","shape":[2]}},"selected":{"id":"59010"},"selection_policy":{"id":"59009"}},"id":"57453","type":"ColumnDataSource"},{"attributes":{"fill_alpha":{"value":0.2},"fill_color":{"v                             q = (i-f)/1000*L*Math.cos(theta)/3600; // m^2/s\n                                D = (3*q*nu/9.81/Math.sin(theta))**(1/3); // m\n                                V = q/D;\n                                Re = 4*q/nu;\n                                z = L*Math.sin(theta);\n                                x = L*Math.cos(theta);\n                                return [q,D,V,Re,z,x]  \n                                }\n                            \n                            // profile calcs and updates //////////////////////\n                            const Dfactor = 500;\n                            var Lprofile = source_Profile.data['L'];\n                            const zmax = Lprofile.at(-1)*Math.sin(Math.atan(S))\n\n                            for (var ii = 0; ii &lt; Lprofile.length; ii++) {\n                                    let parProfile = getOverlandFlowProps(i,f,Lprofile[ii],S)\n                                    \n                                    source_Profile.data['L'][ii] = Lprofile[ii];\n                                    \n                                    const qoutP = parProfile[0]*1000;\n                                    source_Profile.data['q'][ii] = qoutP.toFixed(2);\n                                    \n                                    const DoutP = parProfile[1]*1000;\n                                    source_Profile.data['D'][ii] = DoutP.toFixed(2);\n                                    \n                                    source_Profile.data['V'][ii] = parProfile[2].toFixed(2);\n                                    source_Profile.data['Re'][ii] = parProfile[3].toFixed(2);\n                                    \n                                    const zprof = zmax - parProfile[4]\n                                    source_Profile.data['z'][ii] = zprof.toFixed(2);\n\n                                    const zD = zprof + Dfactor*parProfile[1];\n                                    source_Profile.data['zD'][ii] = zD.toFixed(2);\n                                    source_Profile.data['x'][ii] = parProfile[5].toFixed(2);\n                                    }\n                            \n                                source_Profile.change.emit();\n                                \n                            // slider point plot update ///////////////////////\n                            let par = getOverlandFlowProps(i,f,L,S);\n                            source_SliderPosition.data['x'] = [x,x];\n                            source_SliderPosition.data['y'] = [0,zmax-z+Dfactor*D];\n                            source_SliderPosition.change.emit();\n                            \n                            // L_crit update //////////////////////////////////\n                            var L_crit = [];\n                            var x_crit = [];\n                            var z_crit = [];\n                            var D_crit = [];\n                            var q_crit = [];\n                            var zD_crit = [];\n                            const Re_crit = [2000, 4000];\n                            for (var ii = 0; ii &lt; 2; ii++){\n                                q_crit[ii] = nu*Re_crit[ii]/4;\n                                D_crit[ii] = (3*q_crit[ii]*nu/9.81/Math.sin(theta))**(1/3);\n                                L_crit[ii] = q_crit[ii]/((i-f)/1000/3600*Math.cos(theta));\n                                x_crit[ii] = L_crit[ii]*Math.cos(theta);\n                                z_crit[ii] = L_crit[ii]*Math.sin(theta);\n                                zD_crit[ii] = zmax - z_crit[ii] + Dfactor*D_crit[ii];\n                                }\n                            source_Lcrit.data['x'] = x_crit;\n                            source_Lcrit.data['zD'] = zD_crit;\n                            source_Lcrit.data['L'] = L_crit;\n                            source_Lcrit.change.emit();\n\n                            // output table calcs ///////////////////////////////////\n                            \n                            const qout = q*3600;\n                            const Dout = D*1000;\n                            \n \n                            // update labels //////////////////////////////////\n                            if (i &lt;= f){\n                                    source_Labels.data['label'] = ['*** i &lt; f, =&gt; No Runoff ***',]\n                                    source_OutputTable.data['Value'][0] = NaN;\n                                    source_OutputTable.data['Value'][1] = NaN;\n                                    source_OutputTable.data['Value'][2] = NaN;\n                                    source_OutputTable.data['Value'][3] = NaN;\n                                    source_OutputTable.data['Value'][4] = NaN;\n                                    source_OutputTable.data['Value'][5] = NaN;\n                                    }\n                            if (i &gt; f){\n                                    source_OutputTable.data['Value'][0] = Dout.toFixed(2);\n                                    source_OutputTable.data['Value'][1] = V.toFixed(2);\n                                    source_OutputTable.data['Value'][2] = qout.toFixed(2);\n                                    source_OutputTable.data['Value'][3] = Re.toFixed(0);\n                                    source_OutputTable.data['Value'][4] = L_crit[0].toFixed(2);\n                                    source_OutputTable.data['Value'][5] = L_crit[1].toFixed(2);\n                                    source_Labels.data['label'] = [' ',]\n                                    }\n                            source_Labels.change.emit();\n                            source_OutputTable.change.emit();\n                           \n                         "},"id":"57581","type":"CustomJS"},{"attributes":{},"id":"59031","type":"StringEditor"},{"attributes":{"coordinates":null,"group":null,"source":{"id":"57574"},"text": 58957","type":"StringFormatter"},{"attributes":{"format":"00[.]00","text_align":"center"},"id":"57804","type":"NumberFormatter"},{"attributes":{},"id":"57823","type":"DataRange1d"},{"attributes":{"children":[{"id":"57589"},{"id":"57448"},{"id":"57449"},{"id":"57450"},{"id":"57451"},{"id":"57582"}]},"id":"57590","type":"Column"},{"attributes":{},"id":"56156","type":"AllLabels"},{"attributes":{"bar_color":"firebrick","end":-10,"js_property_callbacks":{"change:value":[{"id":"57277"}]},"start":-50.0,"step":0.1,"title":"Pressure head, psi1 (cm)","value":-30},"id":"57049","type":"Slider"},{"attributes":{"bar_color":"cornflowerblue","end":64,"js_property_callbacks":{"change:value":[{"id":"58258"}]},"start":20,"step":2,"title":"Spillway crest outflow coffeicient, C (-)","value":42},"id":"57800","type":"Slider"},{"attributes":{"height":5,"style":{"font-size":"80%"},"text":"&lt;p&gt;&lt;img src=\"images/copyright-symbol.png\" alt=\"Copyright\" width=\"10\"&gt; 2022, Dr Nick Cartwright, Griffith University&lt;/p&gt;"},"id":"57587","type":"Div"},{"attributes":{"format":"00[.]00","text_align":"center"},"id":"57810","type":"NumberFormatter"},{"attributes":{"text":"&lt;h1&gt;Overland (laminar) flow equations&lt;/h1&gt;\n        &lt;p&gt;This applet applies the steady, uniform flow equation to the case of laminar, overland flow&lt;br&gt;\n            &lt;i&gt;Further details and the equations can be found in the &lt;b&gt;&lt;a href=\"#Background\"&gt;Background&lt;/a&gt;&lt;/b&gt; section below.&lt;/i&gt;&lt;/p&gt;\n        &lt;/p&gt;\n\n        "},"id":"57584","type":"Div"},{"attributes":{"children":[{"id":"57586"},{"id":"57459"}],"width":350},"id":"57591","type":"Column"},{"attributes":{},"id":"57825","type":"LinearScale"},{"attributes":{"children":[{"id":"57590"},{"id":"57591"}]},"id":"57592","type":"Row"},{"attributes":{},"id":"59036","type":"StringEditor"},{"attributes":{"text":"&lt;h2&gt;User Input Controls&lt;/h2&gt;\n                             &lt;p&gt;Move sliders to adjust input parameter values.&lt;br&gt;\n                             &lt;i&gt;&lt;span style=\"color: #ff0000\"&gt;&lt;b&gt;&lt;u&gt;Tip:&lt;/b&gt;&lt;/u&gt;&lt;/span&gt; Click slider and then use left/right arrows on keyboard for greater control.&lt;/i&gt;\n                             &lt;/p&gt;"},"id":"57589","type":"Div"},{"attributes":{},"id":"58912","type":"AllLabels"},{"attributes":{"button_type":"success","icon":null,"js_event_callbacks":{"button_click":[{"id":"57583"}]},"label":"Click to Restore Defaults","width":100},"id":"57582","type":"Button"},{"attributes":{"line_alpha":0.1,"line_color":"green","line_width":2,"x":{"field":"t"},"y":{"field":"I"}},"id":"57849","type":"Line"},{"attributes":{"bar_color":"gold","end":20,"js_property_callbacks":{"change:value":[{"id":"58258"}]},"start":0,"step":0.1,"title":"Time for plot marker, t (hr)","value":1},"id":"57801","type":"Slider"},{"attributes":{},"id":"56278","type":"BasicTickFormatter"},{"attributes":{"sizing_mode":"stretch_width","text":"\n                        &lt;p&gt;&lt;/p&gt;\n        &lt;a name=\"Background\"&gt;&lt;h2&gt;Background&lt;/h2&gt;&lt;/a&gt;\n        \n        &lt;h3&gt;Steady, uniform flow equation&lt;/h3&gt;\n        &lt;p&gt;Under the assumptions of &lt;u&gt;&lt;b&gt;steady, uniform&lt;/b&gt;&lt;/u&gt; flow, application of Newton's 2nd law $$\\left(\\sum F = 0 \\right)$$ to a surface flow system leads to the following equation for the mean flow velocity, &lt;br&gt;\n            $$\\quad V = \\sqrt{\\frac{2g}{C_D}R\\sin{\\theta}} $$ &lt;br&gt;\n            where &lt;br&gt;\n            $$\\qquad R = \\frac{A}{P} $$ is the hydraulic radius $$[L]$$ with $$A$$ the flow cross-sectional area $$[L^2]$$ and $$P$$ the wetted perimeter $$[L]$$. &lt;br&gt;\n            $$\\qquad \\theta$$ is the angle of the overland slope &lt;br&gt;\n            $$\\qquad g = 9.81 m/s^2$$ is the acceleration due to gravity &lt;br&gt;\n            $$\\qquad C_D$$ is the drag coeficient.\n        &lt;/p&gt;\n        \n        &lt;h3&gt;Application to (laminar) overland flow&lt;/h3&gt;\n        \n        &lt;p&gt;For laminar flow, the drag coefficient is given by, &lt;br&gt;\n            $$\\quad C_D = \\frac{24}{Re}$$ &lt;br&gt;\n            where &lt;br&gt;\n            $$\\qquad Re = \\frac{4VD}{\\nu}$$ is the Reynolds number with $$D$$ the mean flow depth and $$\\nu \\left(\\approx 10^{-6} m^2/s \\right)$$ the kinemetic viscosity of water. &lt;br&gt;\n        &lt;/p&gt;\n        &lt;p&gt;Inserting $$C_D$$ into $$V$$ yields the steady, uniform flow equation for the mean flow velocity, &lt;br&gt;\n            $$\\quad V = \\frac{gD^2\\sin{\\theta}}{3\\nu}$$&lt;br&gt;\n            which has two unkowns, $$V$$ and $$D$$. Therefore, a second equation relating these two unkowns is required.\n        &lt;/p&gt;\n        \n        &lt;h3&gt;Conservation of mass&lt;/h3&gt;\n        &lt;p&gt;Application of the conservation of mass principle to a steady, overland flow system yields, &lt;br&gt;\n            $$\\quad q = \\left(i-f\\right)L\\cos{\\theta}$$ &lt;br&gt;\n            where &lt;br&gt;\n            $$\\qquad q = VD$$ is the unit discharge, or flow per unit width $$Q/W$$ $$[L^2/T]$$&lt;br&gt;\n            $$\\qquad i$$ is the rainfall rate $$[L/T]$$&lt;br&gt;\n            $$\\qquad f$$ is the infiltration rate $$[L/T]$$&lt;br&gt;\n            $$\\qquad L$$ is the overland slope length $$[L]$$&lt;br&gt;\n        &lt;/p&gt;\n        \n        &lt;h3&gt;Overland flow equations&lt;/h3&gt;\n        &lt;p&gt;Combing the steady, uniform flow equation (Newton's 2nd law) for $$V$$ with the conservation of mass equation for $$q\\left(=VD\\right)$$ yields the following expression for the mean flow depth, &lt;br&gt;\n            $$\\quad D = \\left(\\frac{3\\nu q}{g \\sin{\\theta}}\\right)^{1/3}$$\n        &lt;/p&gt;\n                    "},"id":"57585","type":"Div"},{"attributes":{"bar_color":"cornflowerblue","end":11.5,"js_property_callbacks":{"change:value":[{"id":"58258"}]},"start":10.5,"step":0.1,"title":"Initial water level, Ho (m, z_spillway = 11m)","value":11.0},"id":"57796","type":"Slider"},{"attributes":{"child":{"id":"55853"},"title":"About"},"id":"55854","type":"Panel"},{"attributes":{"args":{"slider_L":{"id":"57450"},"slider_S":{"id":"57451"},"slider_f":{"id":"57449"},"slider_i":{"id":"57448"},"source_InputParameters":{"id":"57447"}},"code":"\n                                     \n                                         // sliders ///////////////////////////\n                                         slider_i.value = source_InputParameters.data['Value'][0];\n                                         slider_f.value = source_InputParameters.data['Value'][1];\n                                         slider_L.value = source_InputParameters.data['Value'][2];\n                                         slider_S.value = source_InputParameters.data['Value'][3];\n                                         "},"id":"57583","type":"CustomJS"},{"attributes":{},"id":"56279","type":"AllLabels"},{"attributes":{},"id":"56281","type":"BasicTickFormatter"},{"attributes":{},"id":"59032","type":"StringFormatter"},{"attributes":{},"id":"56282","type":"AllLabels"},{"attributes":{"js_property_callbacks":{"change:value":[{"id":"57276"},{"id":"57277"}]},"options":["Sand","Loamy Sand","Sandy Loam","Loam","Silt","Silty Loam","Sandy Clay Loam","Clay Loam","Silty Clay Loam","Sandy Clay","Silty Clay","Clay"],"title":"Select soil type","value":"Sand","width":250},"id":"57041","type":"Select"},{"attributes":{},"id":"59034","type":"UnionRenderers"},{"attributes":{"below":[{"id":"57829"}],"center":[{"id":"57832"},{"id":"57836"},{"id":"57864"},{"id":"57949"}],"height":300,"left":[{"id":"57833"}],"renderers":[{"id":"57851"},{"id":"57870"},{"id":"57888"},{"id":"57894"},{"id":"57959"},{"id":"57979"}],"title":{"id":"57853"},"toolbar":{"id":"57842"},"width":550,"x_range":{"id":"57821"},"x_scale":{"id":"57825"},"y_range":{"id":"57823"},"y_scale":{"id":"57827"}},"id":"57820","subty es":{},"id":"56487","type":"BasicTicker"},{"attributes":{},"id":"58000","type":"WheelZoomTool"},{"attributes":{"autosize_mode":"none","columns":[{"id":"56293"},{"id":"56295"}],"index_position":null,"reorderable":false,"source":{"id":"56291"},"view":{"id":"56299"}},"id":"56297","type":"DataTable"},{"attributes":{},"id":"56480","type":"DataRange1d"},{"attributes":{},"id":"57999","type":"PanTool"},{"attributes":{},"id":"57517","type":"BasicTickFormatter"},{"attributes":{"overlay":{"id":"58002"}},"id":"57998","type":"BoxSelectTool"},{"attributes":{"height":5,"style":{"font-size":"80%"},"text":"&lt;p&gt;&lt;img src=\"images/copyright-symbol.png\" alt=\"Copyright\" width=\"10\"&gt; 2022, Dr Nick Cartwright, Griffith University&lt;/p&gt;"},"id":"56307","type":"Div"},{"attributes":{"coordinates":null,"group":null,"text_color":"#5B5B5B","text_font":"Calibri Light","text_font_size":"1.25em","text_font_style":"bold"},"id":"58809","type":"Title"},{"attributes":{"axis_label":"$$E \\quad (mm/d)$$","axis_label_standoff":10,"axis_label_text_color":"#5B5B5B","axis_label_text_font":"Calibri Light","axis_label_text_font_size":"1.15em","axis_label_text_font_style":"bold","axis_line_alpha":1,"axis_line_color":"#5B5B5B","coordinates":null,"formatter":{"id":"58905"},"group":null,"major_label_policy":{"id":"58906"},"major_label_text_color":"#5B5B5B","major_label_text_font":"Calibri Light","major_label_text_font_size":"0.95em","major_label_text_font_style":"bold","major_tick_in":0,"major_tick_line_alpha":0.25,"major_tick_line_color":"#5B5B5B","major_tick_out":3,"minor_tick_line_alpha":0.25,"minor_tick_line_color":"#5B5B5B","ticker":{"id":"56491"}},"id":"56490","type":"LinearAxis"},{"attributes":{},"id":"56385","type":"BasicTicker"},{"attributes":{"text":"\n        &lt;a id=\"Background\"&gt;&lt;h2&gt;Background&lt;/h2&gt;&lt;/a&gt;\n        \n        &lt;p&gt;Precipitable water is the amount of liqud water that would result from condensing all of the moisture (water vapour) in the atmosphere above us. \n        It represents the water available for potential precipitation, noting that the actual precipitation experienced is greatly influenced by meteorological conditions.\n        &lt;/p&gt;\n\n        &lt;p&gt;The density of a substance is, &lt;br&gt;\n            $$\\quad \\rho = \\frac{m}{V} \\quad (kg/m^3)$$&lt;br&gt;\n            where $$m$$ is the mass $$(kg)$$ and $$V$$ is the volume $$(m^3)$$.\n        &lt;/p&gt;\n        \n        &lt;p&gt;Therefore the mass of precipitable water in air can be found using, &lt;br&gt;\n            $$\\quad m_p = \\rho_v V \\quad (kg)$$ &lt;br&gt;\n            where $$V$$ is the volume of air $$(m^3)$$ and $$\\rho_v$$ is the vapour density $$(kg/m^3)$$ found via the idal gas law, &lt;br&gt;\n            $$\\quad e = \\rho_{v}R_vT \\quad \\left(Pa\\right)$$ &lt;br&gt;\n            where, &lt;br&gt;\n                $$\\qquad R_v = 461J/kg/^\\circ K$$ is the universal gas constant, &lt;br&gt;\n                $$\\qquad T$$ is the temperature in $$^\\circ K$$ $$\\left(=^\\circ C + 273\\right)$$. &lt;br&gt;\n                $$\\qquad e$$ is the vapour pressure $$(Pa)$$, &lt;br&gt;\n                Therefore, &lt;br&gt;\n            $$\\quad \\rho_{v} = \\frac{e}{R_vT}$$ &lt;br&gt;\n        &lt;/p&gt;\n\n        &lt;p&gt;For a given temperature and relative humidity $$R_h$$, vapour pressure $$e$$ is found via the definition, &lt;br&gt;\n            $$\\quad e = R_he_s$$ &lt;br&gt;\n            where $$e_s$$ is the saturation vapour pressure given by, &lt;br&gt;\n            $$\\quad e_s = 611\\exp\\left({\\frac{17.27T}{237.3 + T}}\\right) \\quad (Pa) $$    \n        &lt;/p&gt;\n\n        &lt;p&gt;Combining the above yields,&lt;br&gt;\n            $$\\quad  m_p = \\rho_v V = \\frac{e}{R_vT} V = \\frac{R_he_s}{R_vT} V$$\n        &lt;/p&gt;\n        \n\n        &lt;h3&gt;Estimating the total precipitable water in the troposphere&lt;/h3&gt;\n        \n        &lt;p&gt;\n            The troposphere is the lowest layer of the atmosphere and extends from the Earth's surface up to approximately 10km above the surface. \n            In the troposhere, the air temperature decreases with increasing height above the Earth's surface due to adiabatic cooling. \n            This effect is quantified via the environmental lapse rate, $$ELR \\approx 6.5 ^\\circ/km$$.\n        &lt;/p&gt;\n        &lt;p&gt;\n            That is, the temperature decreases linearly with height at a rate of $$6.5 ^\\circ C$$ per $$km$$ according to, &lt;br&gt;\n                $$\\quad T(z) = T_s - ELR \\times z$$ &lt;br&gt;\n            where $$T_s$$ is the surface temperature and $$z$$ is the elevation above the Earth's surface.\n        &lt;/p&gt;\n        \n        &lt;p&gt;Consequently the vapour density varies with height and therefore the total amount of precipitable water in the troposphere is found by vertically integrating the vapour density. This can be achieved numerically as follows, &lt;br&gt;\n            $$\\quad m_p = \\sum\\limits_{i=1}^N \\Delta m_i = \\sum\\limits_{i=1}^N\\overline{\\rho_v}_i \\Delta V_i = \\sum\\limits_{i=1}^N\\overline{\\rho_v}_i A\\Delta z_i \\quad (kg)$$.&lt;br&gt;\n            where $$i$$ is an integer counter, \n            $$N$$ is the number of discrete height intervals $$(\\Delta z)$$ and\n            $$\\overline{\\rho_v}_i = \\frac{\\rho_{v,i} + \\rho_{v,i+1}}{2}$$ is the average vapour density over the height increment $$\\Delta z_i = z_{i+1}-z_i$$.\n        &lt;/p&gt;\n\n        &lt;p&gt;\n            If we consider a $$1m^2$$ surface area, this reduces to, &lt;br&gt;\n            $$\\quad m_p = \\sum\\limits_{i=1}^N\\overline{\\rho_v}_i \\Delta z_i \\quad (kg/m^2)$$.\n        &lt;/p&gt;\n\n        &lt;p&gt;\n            Lastly, the amount of precipitable water is often presented in terms of an equivalent depth according to,&lt;br&gt;\n            $$\\quad d_p = \\frac{m_p}{\\rho_wA} \\quad (m)$$ &lt;br&gt;\n            Therefore, for a $$1m^2$$ surface area and assuming the density of water $$\\rho_w=1000 \\quad (kg/m^3)$$ yields, &lt;br&gt;\n            $$\\quad d_p = \\frac{m_p}{1000\\times 1} \\quad (m/m^2) = m_p \\quad (mm/m^2)$$\n        &lt;/p&gt;                               \n\n                          "},"id":"56305","type":"Div"},{"attributes":{},"id":"57518","type":"AllLabels"},{"attributes":{},"id":"58001","type":"ResetTool"},{"attributes":{"bottom_units":"screen","coordinates":null,"fill_alpha":0.5,"fill_color":"lightgrey","group":null,"left_units":"screen","level":"overlay","line_alpha":1.0,"line_color":"black","line_dash":[4,4],"line_width":2,"right_units":"screen","syncable":false,"top_units":"screen"},"id":"58002","type":"BoxAnnotation"},{"attributes":{"text":"&lt;h2&gt;User Input Controls&lt;/h2&gt;\n                             &lt;p&gt;Move sliders to adjust input parameter values.&lt;br&gt;\n                             &lt;i&gt;&lt;span style=\"color: #ff0000\"&gt;&lt;b&gt;&lt;u&gt;Tip:&lt;/b&gt;&lt;/u&gt;&lt;/span&gt; Click slider and then use left/right arrows on keyboard for greater control.&lt;/i&gt;\n                             &lt;/p&gt;"},"id":"56309","type":"Div"},{"attributes":{"source":{"id":"56529"}},"id":"56559","type":"CDSView"},{"attributes":{},"id":"57520","type":"BasicTickFormatter"},{"attributes":{"child":{"id":"56313"},"title":"Precipitable Water"},"id":"56314","type":"Panel"},{"attributes":{"coordinates":null,"data_source":{"id":"57803"},"glyph":{"id":"58015"},"group":null,"hover_glyph":null,"muted_glyph":{"id":"58017"},"name":"hover","nonselection_glyph":{"id":"58016"},"view":{"id":"58019"}},"id":"58018","type":"GlyphRenderer"},{"attributes":{"line_alpha":0.2,"line_color":"#1f77b4","x":{"field":"H"},"y":{"field":"O"}},"id":"58011","type":"Line"},{"attributes":{"button_type":"success","icon":null,"js_event_callbacks":{"button_click":[{"id":"56302"}]},"label":"Click to Restore Defaults","width":100},"id":"56301","type":"Button"},{"attributes":{},"id":"56496","type":"WheelZoomTool"},{"attributes":{},"id":"57521","type":"AllLabels"},{"attributes":{"args":{"slider_RelativeHumidity":{"id":"55976"},"slider_SurfaceTemperature":{"id":"55975"}},"code":"\n                                         slider_SurfaceTemperature.value = 28.5;\n                                         slider_RelativeHumidity.value = 55;\n                                         "},"id":"56302","type":"CustomJS"},{"attributes":{"tools":[{"id":"57998"},{"id":"57999"},{"id":"58000"},{"id":"58001"},{"id":"58041"}]},"id":"58003","type":"Toolbar"},{"attributes":{"text":"&lt;h1&gt;Precipitable Water&lt;/h1&gt;\n        &lt;p&gt;This calculation applet estimates the total amount of precipitable water in the lowest $$10km$$ of the atmosphere (ie. the troposphere) by vertically integrating the vapour density $$(\\rho_v)$$ based on user input of surface air temperature and relative humidity. \n        &lt;i&gt;Further details are provided in the &lt;a href=\"#Background\"&gt;&lt;b&gt;Background&lt;/b&gt;&lt;/a&gt; section below.&lt;/i&gt;&lt;/p&gt;\n\n        &lt;p&gt;Explore the relationship between precipiatble water and atmospheric conditions by answering the &lt;a href=\"#TutorialQuestions\"&gt;&lt;b&gt;Tutorial Questions&lt;/b&gt;&lt;/a&gt; below.&lt;/p&gt;\n        "},"id":"56304","type":"Div"},{"attributes":{},"id":"58820","type":"AllLabels"},{"attributes":{"source":{"id":"56423"}},"id":"56453","type":"CDSView"},{"attributes":{"editor":{"id":"58891"},"field":"Value","formatter":{"id":"56292"},"title":"Value","width":80},"id":"56295","type":"TableColumn"},{"attributes":{"editor":{"id":"58890"},"field":"Parameter","formatter":{"id":"56292"},"title":"Parameter","width":220},"id":"56293","type":"TableColumn"},{"attributes":{"line_color":"#1f77b4","x":{"field":"H"},"y":{"field":"O"}},"id":"58009","type":"Line"},{"attributes":{"args":{"slider_RelativeHumidity":{"id":"55976"},"slider_SurfaceTemperature":{"id":"55975"},"source_OutputTable":{"id":"56291"},"source_PrecipitableWater":{"id":"55978"},"source_PrecipitableWaterZ":{"id":"55977"}},"code":"\n                                // Slider data ////////////////////////////////\n                                const Ts = slider_SurfaceTemperature.value;\n                                const Rh = slider_RelativeHumidity.value;\n                                \n                                // calcs //////////////////////////////////////\n                                \n                                function getVapourParameters(T,Rh) {\n                                    const es = 611*Math.exp(17.27*T/(237.3+T));\n                                    const e = Rh/100*es;\n                                    const rho_v = e/461/(273+T)\n                                    return [es, e, rho_v];\n                                    }\n\n                                // update elevation profile ///////////////////\n                                const z = source_PrecipitableWaterZ.data['z']\n                                const dz = source_PrecipitableWaterZ.data['z'][1] - source_PrecipitableWaterZ.data['z'][0]\n                                const lapse_rate = 6.5 // deg/km\n                                var T = []\n                                var es = []\n                                var e = []\n                                var rho_v = []\n                                for (var ii=0; ii&lt;z.length; ii++) {\n                                    T[ii] = Ts - lapse_rate*dz*ii\n                                    let VapourParameters = getVapourParameters(T[ii],Rh)\n                                    es[ii] = VapourParameters[0]\n                                    e[ii] = VapourParameters[1]\n                                    rho_v[ii] = VapourParameters[2]\n                                        }\n                                source_PrecipitableWaterZ.data['T'] = T\n                                source_PrecipitableWaterZ.data['es'] = es\n                                source_PrecipitableWaterZ.data['e'] = e\n                                source_PrecipitableWaterZ.data['rho_v'] = rho_v\n                                source_PrecipitableWaterZ.change.emit();\n                                \n                                // vertical integration ///////////////////////\n                                var T_avg = []\n                                var es_avg = []\n                                var e_avg = []\n                                var rho_v_avg = []\n                                var mp = []                                \n                                for (ii=0; ii&lt;z.length-1; ii++) {\n                                    T_avg[ii] = (T[ii] + T[ii+1])/2\n                                    es_avg[ii] = (es[ii] + es[ii+1])/2\n                                    e_avg[ii] = (e[ii] + e[ii+1])/2\n                                    rho_v_avg[ii] = (rho_v[ii] + rho_v[ii+1])/2\n                                    mp[ii] = rho_v_avg[ii]*dz*1000 \n                                        }\n                                source_PrecipitableWater.data['T'] = T_avg\n                                source_PrecipitableWater.data['es'] = es_avg\n                                source_PrecipitableWater.data['e'] = e_avg\n                                source_PrecipitableWater.data['es_kPa'] = es_avg.map(ii =&gt; ii / 1000)\n                                source_PrecipitableWater.data['e_kPa'] = e_avg.map(ii =&gt; ii / 1000)\n                                source_PrecipitableWater.data['rho_v'] = rho_v_avg\n                                source_PrecipitableWater.data['mp'] = mp\n                                \n                                const mpSum = mp.reduce((partialSum, a) =&gt; partialSum + a, 0);\n                                source_PrecipitableWater.data['rho_v_gm3'] = rho_v_avg.map(ii =&gt; ii * 1000)\n                                source_PrecipitableWater.data['mp'] = mp\n                                source_PrecipitableWater.data['mp_norm'] = mp.map(ii =&gt; ii / mpSum) // normalised by 10km total\n                                source_PrecipitableWater.change.emit();\n                                \n                                // output table ///////////////////////////////\n                                source_OutputTable.data['Value'][0] = mpSum.toFixed(2)\n                                source_OutputTable.change.emit()\n\n                            "},"id":"56300","type":"CustomJS"},{"attributes":{"children":[{"id":"56309"},{"id":"55975"},{"id":"55976"},{"id":"56301"}]},"id":"56310","type":"Column"},{"attributes":{"axis":{"id":"58055"},"coordinates":null,"dimension":1,"group":null,"ticker":null},"id":"58058","type":"Grid"},{"attributes":{"logo":null,"tools":[{"id":"56547"},{"id":"56548"},{"id":"56549"},{"id":"56550"},{"id":"56577"}]},"id":"56552","type":"Toolbar"},{"attributes":{},"id":"57522","type":"UnionRenderers"},{"attributes":{"fill_alpha":{"value":0.2},"fill_color":{"value":"yellow"},"hatch_alpha":{"value":0.2},"line_alpha":{"value":0.2},"marker":{"value":"circle_dot"},"size":{"value":10},"x":{"field":"Hpt"},"y":{"field":"Opt"}},"id":"58023","type":"Scatter"},{"attributes":{"children":[{"id":"56310"},{"id":"56311"}]},"id":"56312","type":"Row"},{"attributes":{"axis_label":"$$T_a \\quad (^\\circ C)$$","axis_label_standoff":10,"axis_label_text_color":"#5B5B5B","axis_label_text_font":"Calibri Light","axis_label_text_font_size":"1.15em","axis_label_text_font_style":"bold","axis_line_alpha":1,"axis_line_color":"#5B5B5B","coordinates":null,"formatter":{"id":"58908"},"group":null,"major_label_policy":{"id":"58909"},"major_label_text_color":"#5B5B5B","major_label_text_font":"Calibri Light","major_label_text_font_size":"0.95em","major_label_text_font_style":"bold","major_tick_in":0,"major_tick_line_alpha":0.25,"major_tick_line_color":"#5B5B5B","major_tick_out":3,"minor_tick_line_alpha":0.25,"minor_tick_line_color":"#5B5B5B","ticker":{"id":"564
