":"55906"}},"id":"55899","subtype":"Figure","type":"Plot"},{"attributes":{},"id":"55909","type":"BasicTicker"},{"attributes":{"data":{"index":[0,1,2,3,4],"x":{"__ndarray__":"AAAAAAAA4L8AAAAAAADgPwAAAAAAAOA/AAAAAAAA4L8AAAAAAADgvw==","dtype":"float64","order":"little","shape":[5]},"y":{"__ndarray__":"MzMzMzMz8z8zMzMzMzPzPzQzMzMzMxNANDMzMzMzE0AzMzMzMzPzPw==","dtype":"float64","order":"little","shape":[5]}},"selected":{"id":"56730"},"selection_policy":{"id":"56729"}},"id":"56670","type":"ColumnDataSource"},{"attributes":{},"id":"55904","type":"LinearScale"},{"attributes":{"bottom_units":"screen","coordinates":null,"fill_alpha":0.5,"fill_color":"lightgrey","group":null,"left_units":"screen","level":"overlay","line_alpha":1.0,"line_color":"black","line_dash":[4,4],"line_width":2,"right_units":"screen","syncable":false,"top_units":"screen"},"id":"56137","type":"BoxAnnotation"},{"attributes":{"source":{"id":"56651"}},"id":"56669","type":"CDSView"},{"attributes":{"end":50,"start":-20},"id":"55900","type":"Range1d"},{"attributes":{"source":{"id":"56684"}},"id":"56690","type":"CDSView"},{"attributes":{"label":{"value":"Saturation vapour pressure, es (Pa)"},"renderers":[{"id":"55930"}]},"id":"55944","type":"LegendItem"},{"attributes":{},"id":"56136","type":"ResetTool"},{"attributes":{"fill_alpha":0.2,"fill_color":"white","hatch_alpha":{"value":0.2},"x":{"field":"x"},"y1":{"field":"y1"},"y2":{"field":"y2"}},"id":"56709","type":"VArea"},{"attributes":{"coordinates":null,"data_source":{"id":"56698"},"glyph":{"id":"56700"},"group":null,"hover_glyph":null,"muted_glyph":{"id":"56702"},"nonselection_glyph":{"id":"56701"},"view":{"id":"56704"}},"id":"56703","type":"GlyphRenderer"},{"attributes":{"overlay":{"id":"56137"}},"id":"56133","type":"BoxSelectTool"},{"attributes":{"line_alpha":0.2,"line_width":0.5,"x":{"field":"x"},"y":{"field":"y"}},"id":"56674","type":"Line"},{"attributes":{},"id":"56134","type":"PanTool"},{"attributes":{},"id":"56135","type":"WheelZoomTool"},{"attributes":{"fill_alpha":0.1,"fill_color":"white","hatch_alpha":{"value":0.1},"x":{"field":"x"},"y1":{"field":"y1"},"y2":{"field":"y2"}},"id":"56708","type":"VArea"},{"attributes":{"logo":null,"tools":[{"id":"55916"},{"id":"55917"},{"id":"55918"},{"id":"55919"},{"id":"55959"}]},"id":"55921","type":"Toolbar"},{"attributes":{"args":{"InitialMoisture_slider":{"id":"57315"},"RainfallRate_slider":{"id":"57314"},"Time_slider":{"id":"57316"},"sourceInfiltrationParameterTable":{"id":"57304"},"sourcePlotSlider_TS":{"id":"57317"},"sourcePondingTime":{"id":"57318"},"sourceProfile_TS":{"id":"57348"},"sourceSoilProperties_ALL":{"id":"57296"},"sourceSoilProperties_SELECTED":{"id":"57297"},"source_Shading":{"id":"57349"}},"code":"\n                        \n                                // soil selection data\n                                var n = sourceSoilProperties_SELECTED.data['Value'][0]\n                                var psi = sourceSoilProperties_SELECTED.data['Value'][1]\n                                var Ks = sourceSoilProperties_SELECTED.data['Value'][2]\n\n                                // Slider data ////////////////////////////////\n                                const rain = RainfallRate_slider.value;\n                                const theta_i = InitialMoisture_slider.value;\n                                const time = Time_slider.value;\n\n                                // Declare variables //////////////////////////\n                                var dTheta, Ns, tp, Fp, F, fc, f, r, L, count, I, R, Fold, dF, Fnew, count\n\n                                // calcs //////////////////////////////////////\n                                function getInfiltrationParameters(n,psi,Ks,rain,theta_i,time) {\n\n                                    // constants\n                                    dTheta = n - theta_i/100\n                                    Ns = dTheta*psi\n                                    \n                                    // G&amp;A F solver function\n                                    function getF(Fp,Ks,tp,time) {\n                                         Fold = Fp + Ks*(time-tp) \n                                         const tol = 10**-10\n                                         dF = tol + 1\n                                         count = 0\n                                         while (dF &gt;= tol) {\n                                             Fnew = Fp + Ks*(time - tp) + Ns*Math.log((Ns + Fold)/(Ns + Fp))\n                                             dF = Math.abs(Fnew - Fold)\n                                             Fold = Fnew\n                                             count = count + 1\n                                             }\n                                         return [Fnew, count]\n                                         }\n                                    \n                                    // physical logic ...\n                                    I = rain*time\n                                    if (rain &lt; Ks) { // ponding never occurs\n                                        // get fc                                                    \n                                        tp = 0;\n                                        Fp = 0;\n                                        let Fcalc = getF(Fp,Ks,tp,time)\n                                        fc = Ks*(1 + Ns/Fcalc[0]);\n                                        // for table\n                                        tp = NaN; \n                                        Fp = NaN;\n                                        F = rain*time;\n                                        r = 0;\n                                        R = 0;\n                                        count = NaN;\n                                        f = rain;\n                                        } \n                                    else { // ponding occurs at some stage\n                                        tp = Ns*Ks/(rain*(rain - Ks));\n                                        if (time &lt; tp) { // pre ponding\n                                            Fp = rain*time;\n                                            R = 0;\n                                            F = rain*time;\n                                            fc = Ks*(1+Ns/F);\n                                            f = rain;\n                                            r = 0;\n                                            count = NaN;\n                                                      }\n                                        else{ // post ponding\n                                            Fp = rain*tp\n                                            let Fcalc = getF(Fp,Ks,tp,time)\n                                            F = Fcalc[0];\n                                            fc = Ks*(1+Ns/F);\n                                            count = Fcalc[1];\n                                            R = I - F\n                                            f = fc\n                                            r = rain - f\n                                             }\n                                        }\n                                    L = F/dTheta\n                                    return [dTheta, Ns, tp, Fp, F, count, L, I, R, fc, f, r];\n                                    }                                    \n \n                                // update table source data ///////////////////\n                                let InfiltrationParameters = getInfiltrationParameters(n,psi,Ks,rain,theta_i,time)\n                                sourceInfiltrationParameterTable.data['Value'][0] = dTheta.toFixed(3); \n                                sourceInfiltrationParameterTable.data['Value'][1] = Ns.toFixed(3);\n                                if (isNaN(tp)) {\n                                        sourceInfiltrationParameterTable.data['Value'][2] = 'No ponding'\n                                        sourceInfiltrationParameterTable.data['Value'][3] = 'No ponding';\n                                        sourceInfiltrationParameterTable.data['Value'][5] = 'No ponding';\n                                        }\n                                else {\n                                    sourceInfiltrationParameterTable.data['Value'][2] = tp.toFixed(3);\n                                    sourceInfiltrationParameterTable.data['Value'][3] = Fp.toFixed(3);\n                                    sourceInfiltrationParameterTable.data['Value'][5] = count.toFixed(0);\n                                    }\n                                sourceInfiltrationParameterTable.data['Value'][4] = F.toFixed(3);\n                                sourceInfiltrationParameterTable.data['Value'][6] = L.toFixed(3);\n                                sourceInfiltrationParameterTable.data['Value'][7] = I.toFixed(3);\n                                sourceInfiltrationParameterTable.data['Value'][8] = R.toFixed(3);\n                                sourceInfiltrationParameterTable.data['Value'][9] = fc.toFixed(3);\n                                sourceInfiltrationParameterTable.data['Value'][10] = f.toFixed(3);\n                                sourceInfiltrationParameterTable.data['Value'][11] = r.toFixed(3);\n                                sourceInfiltrationParameterTable.change.emit();\n                                \n                                // upodated plot slider points ////////////////\n                                sourcePlotSlider_TS.data['xPoint'][0] = time;\n                                sourcePlotSlider_TS.data['xPoint'][1] = time;\n                                sourcePlotSlider_TS.data['xPoint'][2] = time;\n                                sourcePlotSlider_TS.data['xPoint'][3] = time;\n                                sourcePlotSlider_TS.data['yPoint'][0] = rain;\n                                sourcePlotSlider_TS.data['yPoint'][1] = fc;\n                                sourcePlotSlider_TS.data['yPoint'][2] = f;\n                                sourcePlotSlider_TS.data['yPoint'][3] = r;\n                                sourcePlotSlider_TS.change.emit();\n\n                                // update ponding time line and label\n                                sourcePondingTime.data['xAxis'][0] = tp;\n                                sourcePondingTime.data['xAxis'][1] = tp;\n                                sourcePondingTime.data['yAxis'][1] = rain;\n                                sourcePondingTime.change.emit()\n                                \n                                // timeseries profile update //////////////////\n                                const dataProfile_TS = sourceProfile_TS.data;\n                                console.log(dataProfile_TS)\n                                const time_TS = dataProfile_TS['xProfile'];\n                                const i_TS = dataProfile_TS['i'];\n                                const K_TS = dataProfile_TS['K'];                               \n                                const fc_TS = dataProfile_TS['fc'];\n                                const f_TS = dataProfile_TS['f'];\n                                const r_TS = dataProfile_TS['r'];\n                                for (let ii = 0; ii &lt; time_TS.length; ii++) {\n                                        let InfiltrationParameters = getInfiltrationParameters(n,psi,Ks,rain,theta_i,time_TS[ii])\n                                        i_TS[ii] = rain\n                                        K_TS[ii] = Ks\n                                        fc_TS[ii] = InfiltrationParameters[9]\n                                        f_TS[ii] = InfiltrationParameters[10]\n                                        r_TS[ii] = InfiltrationParameters[11]\n                                        }\n                                sourceProfile_TS.change.emit();\n                                \n ne_color":{"field":"color"},"line_width":{"value":2},"size":{"value":10}},"id":"56756","type":"OpenHead"},{"attributes":{},"id":"56198","type":"DataRange1d"},{"attributes":{"callback":null,"names":["profile"],"tooltips":[["Ta (degC)","@xProfile"],["Er (mm/d)","@Er{0.2f}"],["Ea (mm/d)","@Ea{0.2f}"],["Ec (mm/d)","@Ec{0.2f}"]]},"id":"56524","type":"HoverTool"},{"attributes":{"axis":{"id":"56539"},"coordinates":null,"group":null,"ticker":null},"id":"56542","type":"Grid"},{"attributes":{},"id":"58908","type":"BasicTickFormatter"},{"attributes":{},"id":"56544","type":"BasicTicker"},{"attributes":{"button_type":"success","icon":null,"js_event_callbacks":{"button_click":[{"id":"56774"}]},"label":"Click to Restore Defaults","width":100},"id":"56773","type":"Button"},{"attributes":{},"id":"58731","type":"Selection"},{"attributes":{"sizing_mode":"stretch_width","text":"&lt;h2&gt;Background&lt;/h2&gt;\n        &lt;h3&gt;The saturated zone&lt;/h3&gt;\n        &lt;p&gt;The saturated zone is where the pore space is completely full (saturated) with water. \n            In an unconfined aquifer system, the upper bound of the saturated zone is known as the water table (or phreatic surface) which is defined as the surface where the pore water pressure is equal to atmospheric pressure ($$p=0$$).   \n        &lt;/p&gt;\n\n        &lt;h3&gt;Darcy's law: The Darcy flux&lt;/h3&gt;\n        &lt;p&gt;The flow of groundwater is governed by Darcy's law which states that the flow rate is proportional to the driving piezometric head gradient and the hydrualic conductivity. That is, &lt;br&gt;\n            $$\\quad q = -K\\nabla h \\quad [L/T]$$ &lt;br&gt;\n            where \n            $$q$$ is known as Darcy's flux which represents the flow per unit area $$\\left(Q/A\\right)$$, \n            $$K$$ is the hydraulic conductivity $$[L/T]$$ and &lt;br&gt;\n            $$\\quad \\nabla h = \\left( \\frac{\\partial h}{\\partial x} + \\frac{\\partial h}{\\partial y} + \\frac{\\partial h}{\\partial z} \\right) $$ is the piezometric head gradient. \n        &lt;/p&gt;\n\n        &lt;p&gt;\n            The piezometric head represents the potential energy of the (ground)water and is given by, &lt;br&gt;\n            $$\\quad h = z+\\frac{p}{\\rho g} \\quad [L]$$ &lt;br&gt;\n            where $$z$$ the elevation head (the height of the measuring point reletaive to the datum, $$z=0$$) and \n            $$\\frac{p}{\\rho g} $$ is the pressure head (the height of water above the measurement point),\n            $$p \\quad (Pa)$$ is the pore water pressure, $$\\rho \\quad (kg/m^3)$$ is the density of water and $$g = 9.81m/s^2$$ is the acceleration due to gravity.\n        &lt;/p&gt;\n\n        &lt;h3&gt;Darcy's law: Horizontal flow&lt;/h3&gt;\n        &lt;p&gt;For the case of purely horizontal flow in the $$x$$ direction Darcy's law becomes,&lt;br&gt;\n            $$\\quad q = -K\\frac{\\partial h}{\\partial x}$$ &lt;br&gt;\n            which can be evaluated using the finite difference appoximation of the gradient term, that is, &lt;br&gt;\n            $$\\quad q = -K\\frac{\\partial h}{\\partial x} \\approx -K\\frac{\\Delta h}{\\Delta x} = -K\\frac{h_2-h_1}{x_2-x_1}  = -K\\frac{h_1-h_2}{x_1-x_2}  $$ &lt;br&gt;\n        &lt;/p&gt;\n\n        &lt;h3&gt;Seepage velocity&lt;/h3&gt;\n        &lt;p&gt;The seepage velocity $$V$$ accounts for the fact that not all of the flow cross-sectional area $$A$$ is available for flow due to the presence of sediments. \n            The actual area available is $$A_{actual}=An_e$$ since $$n_e$$ represents the void space available for flow hence the adjusted Darcy flux (the seepage velocity) given by, &lt;br&gt;\n            $$\\quad V = \\frac{Q}{A_{actual}} = \\frac{Q}{An_e} = \\frac{q}{n_e}$$\n        &lt;/p&gt;\n                    ","width":400},"id":"56776","type":"Div"},{"attributes":{"axis_label":"$$E \\quad (mm/d)$$","axis_label_standoff":10,"axis_label_text_color":"#5B5B5B","axis_label_text_font":"Calibri Light","axis_label_text_font_size":"1.15em","axis_label_text_font_style":"bold","axis_line_alpha":1,"axis_line_color":"#5B5B5B","coordinates":null,"formatter":{"id":"58917"},"group":null,"major_label_policy":{"id":"58918"},"major_label_text_color":"#5B5B5B","major_label_text_font":"Calibri Light","major_label_text_font_size":"0.95em","major_label_text_font_style":"bold","major_tick_in":0,"major_tick_line_alpha":0.25,"major_tick_line_color":"#5B5B5B","major_tick_out":3,"minor_tick_line_alpha":0.25,"minor_tick_line_color":"#5B5B5B","ticker":{"id":"56544"}},"id":"56543","type":"LinearAxis"},{"attributes":{"text":"&lt;h2&gt;User Input Controls&lt;/h2&gt;\n                             &lt;p&gt;Move sliders to adjust input parameter values.&lt;br&gt;\n                             &lt;i&gt;&lt;span style=\"color: #ff0000\"&gt;&lt;b&gt;&lt;u&gt;Tip:&lt;/b&gt;&lt;/u&gt;&lt;/span&gt; Click slider and then use left/right arrows on keyboard for greater control.&lt;/i&gt;\n                             &lt;/p&gt;"},"id":"56781","type":"Div"},{"attributes":{"args":{"slider_L":{"id":"56614"},"slider_ph1":{"id":"56612"},"slider_ph2":{"id":"56613"},"slider_z1":{"id":"56610"},"slider_z2":{"id":"56611"},"sourceSoilProperties_ALL":{"id":"56602"},"sourceSoilProperties_SELECTED":{"id":"56603"},"source_Arrows":{"id":"56755"},"source_Fill":{"id":"56651"},"source_Labels":{"id":"56752"},"source_OutputTable":{"id":"56616"},"source_Plot_Lines":{"id":"56712"},"source_Qarrow":{"id":"56761"},"source_Well1":{"id":"56670"},"source_Well1_Air":{"id":"56684"},"source_Well1_Water":{"id":"56677"},"source_Well2":{"id":"56691"},"source_Well2_Air":{"id":"56705"},"source_Well2_Water":{"id":"56698"}},"code":"\n                                 \n                                  // get slider values /////////////////////\n                                  const z1 = slider_z1.value;\n                                  const z2 = slider_z2.value;\n                                  const ph1 = slider_ph1.value;\n                    const fac = 10\n                                  source_Labels.data['x'] = [L/2,0,L,0,L,0.025*L,0.97*L,-0.03*L,1.03*L,L/2];\n                                  source_Labels.data['y'] = [0,0,0,0.5*z1,0.5*z2,z1+ph1/2,z2+ph2/2,0.5*h1,0.5*h2,1.3*Math.max(h1,h2)];\n                                  source_Labels.change.emit();\n                                 \n                                  // update wells\n                                  const width_well = 1.; //0.03*L;\n                                 \n                                  source_Well1.data['x'] = [-width_well/2, width_well/2, width_well/2, -width_well/2, -width_well/2]\n                                  source_Well1.data['y'] = [z1, z1, 1.5*Math.max(h1,h2), 1.5*Math.max(h1,h2), z1];\n                                  source_Well1.change.emit();\n                                 \n                                  source_Well1_Water.data['x'] = [-width_well/2, width_well/2]\n                                  source_Well1_Water.data['y1'] = [z1, z1];\n                                  source_Well1_Water.data['y2'] = [h1, h1];\n                                  source_Well1_Water.change.emit();\n                                 \n                                  source_Well2.data['x'] = [L-width_well/2, L+width_well/2, L+width_well/2, L-width_well/2, L-width_well/2];\n                                  source_Well2.data['y'] = [z2, z2, 1.5*Math.max(h1,h2), 1.5*Math.max(h1,h2), z2];\n                                  source_Well2.change.emit();\n                                 \n                                  source_Well2_Water.data['x'] = [L-width_well/2, L+width_well/2]\n                                  source_Well2_Water.data['y1'] = [z2, z2];\n                                  source_Well2_Water.data['y2'] = [h2, h2];\n                                  source_Well2_Water.change.emit();\n                                 \n                                  source_Well1_Air.data['x'] = [-width_well/2, width_well/2];\n                                  source_Well1_Air.data['y1'] = [h1, h1];\n                                  source_Well1_Air.data['y2'] = [1.5*Math.max(h1,h2), 1.5*Math.max(h1,h2)];\n                                  source_Well1_Air.change.emit();\n                                 \n                                  source_Well2_Air.data['x'] = [L-width_well/2, L+width_well/2];\n                                  source_Well2_Air.data['y1'] = [h2, h2];\n                                  source_Well2_Air.data['y2'] = [1.5*Math.max(h1,h2), 1.5*Math.max(h1,h2)];\n                                  source_Well2_Air.change.emit()\n                                 \n                                  // update fill\n                                  //source_Fill.data['x'] = [-0.1*L, 1.1*L];\n                                  source_Fill.data['y2'] = [1.3*Math.max(h1,h2), 1.3*Math.max(h1,h2)];\n                                  source_Fill.change.emit();\n                                 \n                                  "},"id":"56771","type":"CustomJS"},{"attributes":{"coordinates":null,"data_source":{"id":"56529"},"glyph":{"id":"56557"},"group":null,"hover_glyph":null,"name":"profile","view":{"id":"56559"}},"id":"56558","type":"GlyphRenderer"},{"attributes":{},"id":"58905","type":"BasicTickFormatter"},{"attributes":{"args":{"sourceSoilProperties_ALL":{"id":"56602"},"sourceSoilProperties_SELECTED":{"id":"56603"}},"code":"\n                                 // selection /////////////////////\n                                 const Parameter = ['ne', 'Ks (cm/h)'];\n                                 var SoilType = sourceSoilProperties_ALL.data['Soil Type'];\n                                 var ind = SoilType.indexOf(cb_obj.value);\n                                 for (var i = 0; i &lt; Parameter.length; i++) {\n                                     sourceSoilProperties_SELECTED.data['Value'][i] = sourceSoilProperties_ALL.data[Par
